text = {
	["Default"] = { name = "—", desc = "Безименен комплект боя" },
	["so_yellow"] = { name = "Булдозер", desc = "Bulldozer\n \nНякои отделни части са плътно боядисани със спрей в производствено жълта цветова схема.\n\nТази костна трошачка е опустошителна" },
	["so_olive"] = { name = "Подземна вода", desc = "Groundwater\n \nНякои отделни части са плътно боядисани със спрей в еднообразна маслиненозелена цветова схема." },
	["so_red"] = { name = "Захаросана ябълка", desc = "Candy Apple\n \nНякои отделни части са плътно боядисани със спрей в червена и черна цветова схема.\n\nСтрахотно на коли, но по-добро върху оръжия" },
	["so_purple"] = { name = "Ултра виолетово", desc = "Ultraviolet\n \nНякои отделни части са плътно боядисани със спрей в черна и лилава цветова схема.\n\nЕлегантен дизайн, комбиниран с брутален умисъл" },
	["so_night"] = { name = "Нощно", desc = "Night\n \nНякои отделни части са плътно боядисани със спрей в цветовата схема за нощни операции.\n\nТова е шепотът на вятъра… това е ухапването по врата Ви" },
	["so_caramel"] = { name = "Карамелено", desc = "Caramel\n \nНякои отделни части са плътно боядисани със спрей в карамелена и черна цветова схема." },
	["so_grassland"] = { name = "„Тревно“ зелено", desc = "Grassland\n \nНякои отделни части са плътно боядисани със спрей в цветова схема „тревно“ зелено." },
	["so_moss"] = { name = "Син смърч", desc = "Blue Spruce\n \nНякои отделни части са плътно боядисани със спрей в цветова схема „мъх“." },
	["so_sand"] = { name = "„Пясъчна дюна“", desc = "Sand Dune\n \nНякои отделни части са плътно боядисани със спрей в цветова схема „пясъчна дюна“.\n\nСлед като Търнър е мъртъв, имаме нов приоритет: да спасим Алекс Кинкейд — Феликс Райли, команден офицер" },
	["so_stormfront"] = { name = "Буря", desc = "Storm\n \nНякои отделни части са плътно боядисани със спрей в „буреносна“ цветова схема.\n\nЩе те очаква до монорелсата" },
	["so_tornado"] = { name = "„Торнадо“", desc = "Tornado\n \nНякои отделни части са плътно боядисани със спрей в цветова схема „торнадо“.\n\nНе се подвеждайте от простотата му" },
	["so_whiteout"] = { name = "Избелено", desc = "Whiteout\n \nИзцяло е боядисано със спрей в бяло.\n\nИзглежда неопетнено, но видът понякога лъже" },
	["so_jungle"] = { name = "Джунгла", desc = "Jungle\n \nНякои отделни части са плътно боядисани със спрей в цветова схема „джунгла“." },
	["so_space_marine"] = { name = "Колония", desc = "Colony\n \nНякои отделни части са боядисани със спрей в жълтокафяво и сиво." },
	["so_pmc"] = { name = "Предприемач", desc = "Contractor\n \nНякои отделни части са боядисани със спрей в жълто-кафяво, тъмно синьо и зелено.\n\nРона Сабри все още не е простила на Себастиен, за това че не избрал нея да погне Търнър" },
	["so_tangerine"] = { name = "Разрушително", desc = "Demolition\n \nНякои отделни части са плътно боядисани със спрей в черно и мандариново оранжево.\n\nРона е толкова добра, за колкото се мисли… просто не е дорасла достатъчно, за да осъзнае, че е ненужно да го изтъква пред всички — Феликс Райли, команден офицер" },
	["so_orange_accents"] = { name = "Нитро", desc = "so_orange_accents" },
	["cu_broken_path_famas"] = { name = "Послеобраз", desc = "Afterimage\n \nБоядисано е с персонализирани разпокъсани ленти от панделки." },
	["cu_bullet_rain_m4a1"] = { name = "Дъжд от куршуми", desc = "Bullet Rain\n \nБоядисано е с персонализирана графика на облаци, от които валят куршуми." },
	["cu_catskulls_p90"] = { name = "Смърт чрез котенце", desc = "Death by Kitty\n \nУкрасено посредством хидрографика от припокриващи се котешки черепи." },
	["CSGO_Doomkitty"] = { name = "Котенце на гибелта", desc = "CSGO_Doomkitty" },
	["hy_ddpat"] = { name = "Горска разпокъсана цифрова шарка", desc = "Forest DDPAT\n \nOrange DDPAT\n \nUrban DDPAT\n \nPink DDPAT\n \nУкрасено посредством хидрографика от разпокъсана цифрова шарка (DDPAT).\n\nДокато станете достатъчно близо, за да забележите пикселите, вече ще е прекалено късно" },
	["hy_ddpat_urb"] = { name = "Градска разпокъсана цифрова шарка", desc = "hy_ddpat_urb" },
	["hy_ddpat_jungle"] = { name = "Джунглова разпокъсана цифрова шарка", desc = "hy_ddpat_jungle" },
	["hy_ddpat_orange"] = { name = "Оранжева разпокъсана цифрова шарка", desc = "hy_ddpat_orange" },
	["hy_ddpat_pink"] = { name = "Розова разпокъсана цифрова шарка", desc = "hy_ddpat_pink" },
	["hy_ddpat_desert"] = { name = "Пустинна разпокъсана цифрова шарка", desc = "hy_ddpat_desert" },
	["hy_arctic"] = { name = "Арктически камуфлаж", desc = "Arctic Camo\n \nУкрасено посредством хидрографика от арктически камуфлаж.\n\nСнегът е студен. Смъртта е по-студена" },
	["hy_arctic_contrast"] = { name = "Полярен камуфлаж", desc = "hy_arctic_contrast" },
	["hy_arctic_glacier"] = { name = "Арктически камуфлаж", desc = "hy_arctic_glacier" },
	["hy_dive"] = { name = "Подводен камуфлаж", desc = "Arctic Glacier Camo\n \nDive Camo\n \nУкрасено посредством синя камуфлажна хидрографика.\n\nСветът ни е интригуващ, но понякога целта на камуфлажа е да бъде видян — Буут, търговец на оръжия" },
	["hy_ocean"] = { name = "Bright Water", desc = "hy_ocean" },
	["hy_forest"] = { name = "Горски камуфлаж", desc = "Wood Camo\n \nWinter Forest\n \nBoreal Forest\n \nForest Night\n \nУкрасено посредством хидрографика от горски камуфлаж.\n\nГорите могат да бъде опасно място… никога не пътувайте сами" },
	["hy_forest_winter"] = { name = "Зимна гора", desc = "hy_forest_winter" },
	["hy_forest_boreal"] = { name = "Северна гора", desc = "hy_forest_boreal" },
	["hy_forest_night"] = { name = "Горска нощ", desc = "hy_forest_night" },
	["hy_desert"] = { name = "Пустинна буря", desc = "Desert Storm\n \nУкрасено посредством хидрографика от пустинен камуфлаж." },
	["hy_tiger"] = { name = "Бенгалски тигър", desc = "Bengal Tiger\n \nУкрасено посредством хидрографика с тигрова шарка." },
	["hy_copperhead"] = { name = "Медноглава змия", desc = "Copperhead\n \nУкрасено посредством хидрографика с шарка от кожата на медноглава змия." },
	["hy_skulls"] = { name = "Черепи", desc = "Skulls\n \nУкрасено посредством хидрографика от черепна шарка с червени или черни акценти.\n\nМасов гроб, който уютно приляга в дланта на ръката Ви" },
	["hy_webs"] = { name = "Пурпурна паяжина", desc = "Crimson Web\n \nУкрасено посредством хидрографика от паяжинна шарка върху червена основа с полиран завършек.\n\nВнимавайте къде се разхождате, никога не се знае колко се е разпростряла паяжината" },
	["hy_splatter"] = { name = "Сини ивици", desc = "Blue Streak\n \nУкрасено посредством полупрозрачна хидрографика с шарка от изпръскани ивици върху покритие в морско синьо." },
	["hy_ak47lam"] = { name = "Червен ламинат", desc = "Black Laminate\n \nBlue Laminate\n \nRed Laminate\n \nНаправен е ламиниран приклад." },
	["hy_ak47lam_bw"] = { name = "Черен ламинат", desc = "hy_ak47lam_bw" },
	["hy_ak47lam_blue"] = { name = "Син ламинат", desc = "hy_ak47lam_blue" },
	["hy_gelpen"] = { name = "Димящо дуло", desc = "Gunsmoke\n \nУкрасено посредством хидрографика на рисунка от писалка с гел." },
	["hy_v_tiger"] = { name = "Тигър от джунглата", desc = "Jungle Tiger\n \nУкрасено посредством хидрографика от тигрови ивици с цветове от джунглата." },
	["hy_redtiger"] = { name = "Кървав тигър", desc = "hy_redtiger" },
	["hy_zombie"] = { name = "Вирус", desc = "Virus\n \nУкрасено посредством хидрографика със зомби върху зелено покритие." },
	["hy_granite"] = { name = "Гранит и мрамор", desc = "Granite Marbleized\n \nУкрасено посредством хидрографика от мраморна шарка." },
	["hy_blizzard"] = { name = "Мраморна виелица", desc = "hy_blizzard" },
	["hy_sediment"] = { name = "Тиня", desc = "hy_sediment" },
	["hy_reef_rock"] = { name = "Цианидни пръски", desc = "hy_reef_rock" },
	["sp_spray"] = { name = "Контрастен спрей", desc = "Jungle Spray\n \nContrast Spray\n \nWave Spray\n \nSage Spray\n \nSand Spray\n \nArmy Recon\n \nБоядисано със спрей чрез ръчно рисувани къси, плътни линии в контрастни цветове.\n\nПерфектно за бунтовниците в движение" },
	["sp_spray_sage"] = { name = "Сиво-зелен спрей", desc = "sp_spray_sage" },
	["sp_spray_jungle"] = { name = "Спрей „Джунгла“", desc = "sp_spray_jungle" },
	["sp_spray_sand"] = { name = "Пясъчен спрей", desc = "sp_spray_sand" },
	["sp_spray_waves"] = { name = "Вълнообразен спрей", desc = "sp_spray_waves" },
	["sp_spray_army"] = { name = "Военно разузнаване", desc = "sp_spray_army" },
	["sp_tape_dots"] = { name = "Сух сезон", desc = "Urban Perforated\n \nDry Season\n \nWaves Perforated\n \nБоядисано със спрей чрез разкъсани парчета лента и перфориран метал, ползвани като шаблони." },
	["sp_tape_dots_urban"] = { name = "Градски перфориран", desc = "sp_tape_dots_urban" },
	["sp_tape_dots_waves"] = { name = "Перфорирани вълни", desc = "sp_tape_dots_waves" },
	["sp_leaves"] = { name = "Горски листа", desc = "Forest Leaves\n \nGrassland Leaves\n \nБоядисано със спрей чрез листа, ползвани като шаблони." },
	["sp_leaves_grassland"] = { name = "Прерийни листа", desc = "sp_leaves_grassland" },
	["sp_short_tape"] = { name = "Покрито с лишеи", desc = "Urban Dashed\n \nLichen Dashed\n \nJungle Dashed\n \nSand Dashed\n \nБоядисано със спрей чрез къси парчета лента, ползвани като шаблони." },
	["sp_short_tape_jungle"] = { name = "Покритие „джунгла“", desc = "sp_short_tape_jungle" },
	["sp_short_tape_sand"] = { name = "Пясъчно покритие", desc = "sp_short_tape_sand" },
	["sp_short_tape_urban"] = { name = "Градско покритие", desc = "sp_short_tape_urban" },
	["sp_tape"] = { name = "Маска от кости", desc = "Urban Masked\n \nBone Mask\n \nOrange Peel\n \nБоядисано със спрей чрез плетеница от самозалепваща лента, ползвана като шаблон.\n\nСъщинската мощ се демонстрира чрез изтънчено приложение" },
	["sp_tape_orange"] = { name = "Портокалова кора", desc = "sp_tape_orange" },
	["sp_tape_urban"] = { name = "Градска маскировка", desc = "sp_tape_urban" },
	["sp_mesh"] = { name = "Дърводобивна мрежа", desc = "Glacier Mesh\n \nSafari Mesh\n \nPolar Mesh\n \nCondemned\n \nSand Mesh\n \nTeardown\n \nGator Mesh\n \nArmy Mesh\n \nDriftwood Mesh\n \nБоядисано със спрей чрез метална мрежа и изрезки от картон, ползвани като шаблони.\n\nХищникът си остава такъв, независимо от обкръжението" },
	["sp_mesh_tan"] = { name = "Мрежа за сафари", desc = "sp_mesh_tan" },
	["sp_mesh_arctic_contrast"] = { name = "Полярна мрежа", desc = "sp_mesh_arctic_contrast" },
	["sp_mesh_fire"] = { name = "Обезлюдено", desc = "sp_mesh_fire" },
	["sp_mesh_glacier"] = { name = "Ледена мрежа", desc = "sp_mesh_glacier" },
	["sp_mesh_sand"] = { name = "Пясъчна мрежа", desc = "sp_mesh_sand" },
	["sp_snake"] = { name = "Змийски камуфлаж", desc = "Snake Camo\n \nБоядисано със спрей чрез шаблон от парчета змийска кожа, които са очертани ръчно." },
	["an_silver"] = { name = "Сребро", desc = "Silver\n \nБоядисано в прозиращ сребърен слой с анодно оксидиран ефект върху хромирана основа.\n\nИма красота в простотата — Франц Крийгелд, тактик на Феникс" },
	["an_red"] = { name = "Хот род", desc = "Hot Rod\n \nБоядисано в прозиращ червен слой с анодно оксидиран ефект върху хромирана основа.\n\nАвтоматично. Систематично. Хидроматично." },
	["an_gunmetal"] = { name = "Анодно оксидирана метална сплав", desc = "an_gunmetal" },
	["an_navy"] = { name = "Анодно оксидирано тъмносиньо", desc = "Anodized Navy\n \nБоядисано в прозиращ тъмносин слой с анодно оксидиран ефект върху хромирана основа." },
	["am_urban"] = { name = "Металическа разпокъсана цифрова шарка", desc = "Metallic DDPAT\n \nУкрасено посредством хидрографика от разпокъсана градска цифрова шарка (DDPAT) върху основа тип металик." },
	["am_tiger"] = { name = "Златен тигър", desc = "Gold Tiger\n \nПозлатено и ръчно гравирано в шарка с райета на тигър." },
	["am_dragon_glock"] = { name = "Драконова татуировка", desc = "Dragon Tattoo\n \nУкрасено посредством щампа на дракон върху основа тип металик.\n\nВ приказките рицарят винаги убива ламята, но това е реалният свят — Валерия Дженър, революционерка" },
	["am_caustics"] = { name = "Химично изгаряне", desc = "Caustics\n \nУкрасено посредством червено и бяла хидрографика върху овъглена основа тип металик." },
	["am_lightning_awp"] = { name = "Удар от мълния", desc = "Lightning Strike\n \nБоядисано в мотив от мълния с анодно оксидиран ефект върху основа тип металик.\n\nПонякога не е нужно да удряте на едно и също място два пъти" },
	["am_ossify"] = { name = "Вкостенено", desc = "Ossified\n \nУкрасено посредством прозираща абстрактна жълто-зелена хидрографика върху основа тип металик." },
	["aa_flames"] = { name = "Лумване", desc = "Blaze\n \nНанесени прозиращи бои, чрез аерограф върху хромирана основа." },
	["aa_splash_p250"] = { name = "Плясък", desc = "Splash\n \nНанесени прозиращи бои чрез аерограф с шаблон върху хромирана основа." },
	["aa_fade"] = { name = "Избледняване", desc = "Fade\n \nAmber Fade\n \nAcid Fade\n \nНанесени прозиращи бои чрез аерограф, които преливат от една в друга върху хромирана основа.\n\nТова не е просто оръжие, а тема за разговор — Имоджен, търговец на оръжие по време на обучение" },
	["aa_fade_metallic"] = { name = "Избледняващ кехлибар", desc = "aa_fade_metallic" },
	["aa_fade_grassland"] = { name = "Избледняваща киселина", desc = "aa_fade_grassland" },
	["aq_copper"] = { name = "Медно", desc = "Copper\n \nИма направено медно покритие." },
	["aq_blued"] = { name = "Синя стомана", desc = "Blue Steel\n \nОксидирано е в синьо.\n\nТова е малбекът на оръжейния дизайн — Буут, търговец на оръжия" },
	["aq_forced"] = { name = "Опетнено", desc = "Stained\n \nПринудително патинирано посредством капещи върху повърхността лимон и горчица.\n\nАко мислите, че в момента е мръсно, почакайте, докато го видя под ултравиолетово осветление" },
	["aq_oiled"] = { name = "Закалено", desc = "Case Hardened\n \nЦветът е променен поради закаляване чрез прилагането на дървени въглища при високи температури.\n\nМалко цвят никога не навредил на някого" },
	["sp_spitfire_famas"] = { name = "Избухливо", desc = "sp_spitfire_famas" },
	["am_zebra"] = { name = "Клане", desc = "Slaughter\n \nУкрасено посредством шарка от ивици на зебра с алуминиеви и хромирани бои, които имат различни отразяващи характеристики, и след това облято в доматено червено покритие.\n\nВалерия не плаща на Хавиер да задават въпроси… прави го за изтръгването на отговори" },
	["am_zebra_dark"] = { name = "Черна вода", desc = "Dark Water\n \nУкрасено посредством шарка от водни ивици с овъглени бои тип металик, които имат различни отразяващи характеристики върху хромирана основа.\n\nВодата дарява с живот, но също така може и да го отнема…" },
	["aa_vertigo"] = { name = "Хипнотично", desc = "Hypnotic\n \nНанесена графична шарка чрез шаблон с черен спрей върху перлена основа.\n\nНе Ви се доспива, а изпадате в безсъзнание, поради загуба на кръв" },
	["cu_spring_nova"] = { name = "Пушкалото на разцвета", desc = "Bloomstick\n \nРъчно нанесен мотив на черешов цвят чрез аерограф, а след това е придадено силно гланцирано покритие." },
	["sp_hazard"] = { name = "Опасност", desc = "sp_hazard" },
	["aq_rust"] = { name = "Ръждиво", desc = "Rusty\n \nВъпреки че външната повърхност е ръждясала, това оръжие все още функционира отлично." },
	["am_slither_p90"] = { name = "Хладнокръвно", desc = "Cold Blooded\n \nБоядисано в прозиращ червен слой с анодно оксидиран ефект върху хромирана основа. А след това е лазерно гравирано с мотив от прокрадваща се змия." },
	["am_carbon_fiber"] = { name = "Карбонови нишки", desc = "Carbon Fiber\n \nУкрасено посредством хидрографика от карбонови нишки върху графитна основа.\n\nСамо защото аз поведох екипа, не значи, че усилието не беше отборно — Рона Сабри, изгряваща звезда" },
