	["hy_siege_bravo"] = { name = "Обрастване", desc = "Overgrowth\n \nТози сувенир от Siege е украсен чрез камуфлажна хидрографика.\n\nПогледни ме в очите и ми кажи, че е стандартно оборудване — Феликс Райли, команден офицер" },
