	["an_emerald_bravo"] = { name = "Emerald", desc = "Emerald\n \nТози сувенир от Chinatown е боядисан в прозиращ изумруденозелен слой с анодно оксидиран ефект върху хромирана основа.\n\nДо това ли е бил принизен великият Себастиен Хенекет? Заядлив стар учител? Какво е станало с теб… — „Учителят и иконоборецът“ част II" },
