	["cu_money"] = { name = "Франклин", desc = "Franklin\n \nУкрасено посредством хидрографика от сто доларови американски банкноти.\n\nПарите не говорят… те убиват" },
	["so_orca"] = { name = "Смокинг", desc = "Tuxedo\n \nНякои отделни части са плътно боядисани със спрей в черно-бяла цветова схема.\n\nЗа моментите, когато битките налагат черни вратовръзки" },
	["am_army_shine"] = { name = "Армейски гланц", desc = "Army Sheen\n \nПокрито в метално фолио, щамповано с камуфлажна шарка.\n\nПомнете обучението си" },
	["am_oval_hex"] = { name = "Стоманена клетка", desc = "Caged Steel\n \nУкрасено чрез шарка от шестоъгълници, нанесени посредством шаблон, като е използвана боя с метални люспици, а след това покрито с овално изрязана хидрографика.\n\nКажете матирано!" },
	["cu_pinstripe_ak47"] = { name = "Изумрудени ивици", desc = "Emerald Pinstripe\n \nНаправен е приклад от абанос, боядисан в бели и зелени ивици.\n\nАко поставяте Имоджен под съмнение, значи оспорвате и мен. Сега се успокойте, ето малко скоч, и нека да поговорим делово — Бащата и фениксът, част II" },
	["sp_nightstripe"] = { name = "Нощно райе", desc = "Night Stripe\n \nБоядисано със спрей чрез шарка от самозалепваща лента в нощна цветова схема.\n\nПръскайте със спрея… Молете се… Боядисвайте… Намушвайте." },
	["cu_m4_asimov"] = { name = "Азимов", desc = "Asiimov\n \nБоядисано с персонализиран научно фантастичен дизайн.\n\nВсеки може да предскаже бъдещето… мечтателят го извайва" },
	["cu_sawedoff_octopump"] = { name = "Кракенът", desc = "The Kraken\n \nРъчно изрисувано с изображение на октопод.\n\nВече е отприщен" },
	["cu_m4a1-s_elegant"] = { name = "Пазител", desc = "Guardian\n \nБоядисано е в кобалтово синьо и щамповано с логото на КТ върху пълнителя.\n\nНе е необходимо да Ви харесвам. Трябва да Ви пазя в безопасност — Кармен Косинеро, спасителен експерт" },
	["cu_p250_refined"] = { name = "Мехди", desc = "Mehndi\n \nУкрасено посредством хидрографика с шарка в индийски мотив.\n\nНамасте" },
	["cu_awp_cobra"] = { name = "Червена линия", desc = "Redline\n \nУкрасено посредством хидрографика от карбонови нишки и самозалепваща се щампа на червени ивици.\n\nНикога не се притеснявайте да стигнете до крайния предел" },
	["cu_famas_pulse"] = { name = "Пулс", desc = "Pulse\n \nУкрасено посредством хидрографика на големи фрагменти от обеци.\n\nУдивителни цветове за едно поразително оръжие" },
	["hy_marina_sunrise"] = { name = "Яхтклуб", desc = "Marina\n \nУкрасено посредством хидрографика в контрастна жълто-синя шарка.\n\nНякои хора ще Ви нарекат герой… други — злодей" },
	["am_thorny_rose_mp9"] = { name = "Желязна роза", desc = "Rose Iron\n \nРъчно изрисувано в мотив на роза с бодли чрез разноцветни бои тип металик.\n\nПазете се от множеството ѝ бодли" },
	["cu_skull_nova"] = { name = "Извисяващ череп", desc = "Rising Skull\n \nПерсонализирано посредством изображение на череп, нанесено чрез маркировка от матови и маслени бои.\n\nГ-н Изаки, не се оплаквам, но колко пушки са Ви необходими? — Имоджен и Они, част I" },
	["cu_sandstorm"] = { name = "Пясъчна буря", desc = "Sandstorm\n \nУкрасено посредством хидрографика в лилав и бежов графичен дизайн.\n\nЩе Ви е необходимо нещо повече от брезент, за да се предпазите" },
	["hy_kami"] = { name = "Ками", desc = "Kami\n \nУкрасено посредством хидрографика от шарка в стила на Японска манга.\n\nНякои духове просто няма да останат погребани" },
	["aq_obsidian"] = { name = "Магма", desc = "Magma\n \nИма части с медно покритие, които са прикрити с шарка от магма и придадена червена патина посредством натриев хлорид и висока температура. В последствие непокритите области са потъмнени чрез окисляване с калиев сулфид.\n\nИзгаряща честота на стрелба" },
	["am_turqoise_halftone"] = { name = "Кобалтова фотогравюра", desc = "Cobalt Halftone\n \nУкрасено посредством хидрографика от шарка на уголемена фотогравюра върху тюркоазна основа тип металик.\n\nФеликс, двамата с теб знаем, че Валерия се подготвя да води война. Единственият въпрос е, дали ти си готов? — Буут, търговец на оръжия" },
	["cu_aug_chameleonaire"] = { name = "Хамелеон", desc = "Chameleon\n \nБоядисано с персонализирано изображение на хамелеон.\n\nФинесът може да е от огромно значение" },
	["cu_ump_corporal"] = { name = "Ефрейтор", desc = "Corporal\n \nБоядисано с персонализиран военен мотив.\n\nУважението никога не може бъде взето, само заслужено" },
	["cu_p90_trigon"] = { name = "Тригонометрично", desc = "Trigon\n \nБоядисано в персонализирано контрастиращо оранжево, сиво и черно.\n\nПревърнете се в човешки тайфун" },
	["cu_mac10_redhot"] = { name = "Жега", desc = "Heat\n \nБоядисано в персонализиран вид, така че да изглежда сякаш току-що е излязло от пещта.\n\nНаправете няколко Ваши собствени контури" },
	["sp_negev_turq_terrain"] = { name = "Почва", desc = "Terrain\n \nУкрасено посредством хидрографика с мотив от земна почва.\n\nЗа някой, който би трябвало да е безпристрастен, дъщеря Ви си избра интересен другар — Бащата и фениксът, част I" },
