	["am_metal_inlay"] = { name = "Мрачна епоха", desc = "Dark Age\n \nБоядисано с металически бои, за да изглежда сякаш е инкрустирано с метали в средновековен мотив.\n\nБих могъл да убия нейния любовник… може би това ще ти даде малко време с Валерия — „Бащина любов“, част II" },
