	["so_indigo"] = { name = "Кралско синьо", desc = "Royal Blue\n \nБоядисано е плътно в индиго, червено и сиво.\n\nТрябва да се усмихваш, Феликс. Ще имаш повече успех с дамите, ако не изглеждаш като такова намусено копеле през цялото време — Имоджен, оръжеен търговец по време на обучение" },
