	["cu_well_traveled_ak47"] = { name = "Туристически стикери", desc = "Jet Set\n \nПрикладът е обвит в кафява кожа. Това оръжие е обиколило доста градове.\n\nВсеки, обърнал особено внимание, ще свърже точките, разбирайки какво е направила тя. Нямаме много време, за да намерим решение… — „Бащина любов“, част I" },
