	["cu_m4a4_griffin"] = { name = "Грифон", desc = "Griffin\n \nРъчно изрисувано с илюстрация на грифон.\n\nФеликс собственоръчно подбра своя екип оперативни агенти от целия свят… макар хората да поставят под съмнение тяхната индивидуалност, никога не се съмняват в резултатите" },
	["sp_mag7_firebitten"] = { name = "Подпалвач", desc = "Firestarter\n \nБоядисано със спрей на слоеве, а след това умишлено занемарено, така че да създаде впечатление за горящи ръбове.\n\nВинаги се започва с една мъничка искра" },
