	["cu_p2000_fire_elemental"] = { name = "Огнена стихия", desc = "Fire Elemental\n \nБоядисано с персонализиран графичен дизайн чрез изображение на създание, направено от огън.\n\nПонякога играта с огъня е нещо добро" },
	["aq_sawedoff_blackgold"] = { name = "Разбойник", desc = "Highwayman\n \nЛакирано в черно и златисто с мотив от шотландски магарешки бодил.\n\nНе е необходимо да изпъвате кутрето си, когато дърпате спусъка, но това е добър детайл" },
	["cu_scar20_intervention"] = { name = "Сърдечно", desc = "Chardiac\n \nТоплинно опаковано в предварително щампован винил с модернистичен дизайн от оранжево и синьо.\n\nпиук. пиук. пиуууууууууууук…" },
	["sp_ump45_d-visions"] = { name = "Илюзия", desc = "Delusion\n \nУкрасено чрез ситопечатен дизайн с наутилуси.\n\nОбажда се Каркоза" },
