	["am_awp_glory"] = { name = "Военнослужещ", desc = "Man-o'-war\n \nПридадена е основа тип син металик, след което е ръчно изрисувано със златисти спирали и акценти.\n\nНакарайте няколко глави да се обърнат след Вас, преди да ги отнесете" },
	["cu_elites_urbanstorm"] = { name = "Градски сблъсък", desc = "Urban Shock\n \nБоядисано с персонализиран камуфлажен дизайн със сини акценти.\n\nСветкавицата винаги е следвана от гръмотевица" },
	["aq_deagle_naga"] = { name = "Нага", desc = "Naga\n \nГравирано с митологичен мотив.\n\nЗвяр както в индийската митология, така и на бойното поле" },
	["cu_galil_abrasion"] = { name = "Кречетало", desc = "Chatterbox\n \nРъчно изрисувано и умишлено занемарено. Черепът, който е изрисуван върху противопраховия капак, изглежда сякаш дърдори, когато пластината се движи напред-назад.\n\nНякои казват, че когато се смеете, светът се смее редом с Вас… но когато „Кречеталото“ се смее, има само писъци" },
	["cu_glock_deathtoll"] = { name = "Катакомби", desc = "Catacombs\n \nУкрасено посредством хидрографика с черепи върху сребриста основа тип металик.\n\nСплашването е най-искрената форма на ласкателство" },
	["cu_m4a4_ancestral"] = { name = "龍王 (Кралят на драконите)", desc = "龍王 (Dragon King)\n \nБоядисано с персонализирано изображение на дракон в червено и синьо.\n\nОръжие, достойно за самия крал на маймуните — Буут, търговец на оръжие" },
	["cu_m249_sektor"] = { name = "Системно заключване", desc = "System Lock\n \nБоядисано с персонализиран научно фантастичен дизайн.\n\nПрикриващият огън никога не е изглеждал толкова добре" },
	["am_mac10_malachite"] = { name = "Малахит", desc = "Malachite\n \nБоядисано с ефект от металически бои и придадена вълниста шарка чрез гумен гребеновиден инструмент.\n\nЯрките цветове прикриват оръжие с мрачна цел" },
	["cu_mp9_deadly_poison"] = { name = "Смъртоносна отрова", desc = "Deadly Poison\n \nБоядисано с персонализирани динамични ъглови форми и стилизиран паяк.\n\nПървата хапка няма да Ви убие, ще го сторят онези 29 след нея" },
	["cu_p250_mandala"] = { name = "Мъртъв", desc = "Muertos\n \nБоядисано с персонализирани кръгови мотиви.\n\nТова е пропито с кръв и традиции" },
	["cu_sawedoff_deva"] = { name = "Ведрина", desc = "Serenity\n \nРъчно изрисувано с изображение на крилата жена.\n\nСпокойствието е лукс, който малцина могат да си позволят — Валерия Дженър, революционерка" },
	["aq_scar20_leak"] = { name = "Изкуствена пещера", desc = "Grotto\n \nБоядисано е чрез гъба и четка с ефект от сини металически бои.\n\nОснователят на корпорация „Сезон“ поръча тази специална изработка, след като беше спасен от прославения агент Котаро Изаки" },
	["aq_xm1014_sigla"] = { name = "Живак", desc = "Quicksilver\n \nУкрасено посредством полупрозрачна хидрографика с мотив на топографска карта върху сребърна металическа основа.\n\nПонякога е необходим нестабилен елемент, за да решите проблемите си — Котаро Изаки, експерт по пробивите" },
	["an_tiger_orange"] = { name = "Тигров зъб", desc = "Tiger Tooth\n \nАнодно оксидирано в оранжево и ръчно гравирано с тигрова шарка.\n\nРядко срещано е както тигъра… и подобно на него е толкова смъртоносно…" },
	["am_marble_fade"] = { name = "Мраморно преливане", desc = "Marble Fade\n \nБоядисано с черни и сребристи металически бои чрез използване на разтворител, придаващ мраморен вид, а след това е облято в три цвята.\n\nОстрието може и да е многоцветно, но скоро ще бъде изцяло червено" },
	["am_marbleized"] = { name = "Доплер", desc = "Doppler\n \nБоядисано с черни и сребристи металически бои чрез използване на разтворител, придаващ мраморен вид, а след това е облято в един цвят.\n\nАко цветът му Ви завладее, това може да се окаже фатално" },
	["cu_ak47_mastery"] = { name = "Elite Build", desc = "It has been custom painted using a combination of hydrographics and careful stenciling and detailed with heat-transfer decals.\n\nTread softly Naomi...people in your line of work aren't known for their longevity - The Shield and The Serpent Part 2" },
	["aq_mp7_ultramodern"] = { name = "Бронирано ядро", desc = "Armor Core\n \nБоядисано с черни маслени бои, придадени са части от неръждаема стомана и инкрустации.\n\nПерфектно за оператора, който цени изтънчеността, както и огневата мощ — Буут, търговец на оръжия" },
	["aq_awp_twine"] = { name = "Богът червей", desc = "Worm God\n \nБоядисано с изображение от черепа и корени, чрез използвани дълготрайни емайллакове.\n\nИма някои корени, които не искате да Ви задържат" },
	["am_bronze_sparkle"] = { name = "Бронзово арт деко", desc = "Bronze Deco\n \nБоядисано в арт деко шарка, използвайки автомобилни бои тип металик.\n\nВсички търсят сребро и злато" },
	["aq_p250_contour"] = { name = "Валентност", desc = "Valence\n \nБоядисано с персонализиран в модерен синьо-сив дизайн, който допринася към очертанията на оръжието.\n\nНе се оспорват Вашите умения, а отношението Ви — „Учителят и иконобореца“ част I" },
