	["cu_galil_eco"] = { name = "Еко", desc = "Eco\n \nБоядисано в бяло, зелено и подчертано чрез топлинно приложени щампи.\n\nЗа достатъчно пари, „Елитния отряд“ ще се нагърби с всяка кауза сякаш е тяхна собствена" },
