	["hy_icarus"] = { name = "Падането на Икар", desc = "Icarus Fell\n \nУкрасено посредством хидрографика от пера и разтопен восък около слънчев мотив.\n\nПредателството на Търнър е мой провал… трябва да поправя това — Себастиен Хенекет, снайперист" },
	["cu_labyrinth"] = { name = "Лабиринтът на минотавъра", desc = "Minotaur's Labyrinth\n \nУкрасено посредством хидрографика на изометричен лабиринт.\n\nНяма измъкване от мен" },
	["sp_labyrinth1"] = { name = "Астерион", desc = "Asterion\n \nБоядисано със спрей чрез шаблон на изометричен лабиринт.\n\nЦарете са просто хора, а никой човек не трябва да бъде издиган в култ — Валерия Дженър, революционерка" },
	["sp_labyrinth2"] = { name = "Пътеводител", desc = "Pathfinder\n \nБоядисано със спрей чрез шаблон на изометричен лабиринт.\n\nАз лично предпочитам четвъртото издание, но клиентът винаги е прав — Буут, търговец на оръжия" },
	["sp_labyrinth3"] = { name = "Дедал", desc = "Daedalus\n \nБоядисано със спрей чрез шаблон на изометричен лабиринт.\n\nИмоджен… ако някога разберат какво си сторила, това може да ни струва живота — „Семейна история“, част I" },
	["cu_medusa_awp"] = { name = "Медуза", desc = "Medusa\n \nБоядисано с персонализирано изображение на горгона.\n\nАко ме виждате, значи вече сте мъртви" },
	["gs_mother_of_pearl_elite"] = { name = "Дуелист", desc = "Duelist\n \nПридадени са боядисани седефни захвати и принудително нанесена тъмна патина.\n\nДъвката не е включена в комплекта" },
	["aa_pandora"] = { name = "Кутията на Пандора", desc = "Pandora's Box\n \nНанесени са анимационни духове чрез аерограф.\n\nСветът е в пламъци, но поне имаме надежда" },
	["cu_poseidon"] = { name = "Посейдон", desc = "Poseidon\n \nБоядисано с персонализирано изображение на битка между Риби и Посейдон.\n\nТрима могат да опазят една тайна, ако двама от тях са мъртви" },
	["hy_zodiac1"] = { name = "Луната във Везни", desc = "Moon in Libra\n \nУкрасено посредством хидрографика със зодиакален мотив.\n\nДнес е чудесен ден да откриете романтиката и убиете съперниците си" },
	["hy_zodiac2"] = { name = "Слънцето в Лъв", desc = "Sun in Leo\n \nУкрасено посредством хидрографика със зодиакален мотив.\n\nТова ще бъде труден месец за враговете Ви" },
	["hy_zodiac3"] = { name = "Прогноза за доставка", desc = "Shipping Forecast\n \nУкрасено посредством хидрографика със зодиакален мотив.\n\nКой знае какво крие бъдещето" },
	["so_khaki_green"] = { name = "Едва зелено", desc = "Para Green\n \nНякои отделни части са плътно боядисани със спрей в сиво-кафява, зелена и черна цветова схема.\n\nКой е бил, не променя това в какво се е превърнал. Не се притеснявай, Феликс… аз ще го спра — „Паладинът и учителят“, част II" },
	["cu_anime_aug"] = { name = "Акихабара приема", desc = "Akihabara Accept\n \nУкрасено посредством топлинно приложена щампа от корица на аниме списание.\n\nЯ̀та!" },
	["am_bamboo_jungle"] = { name = "Хидропоника", desc = "Hydroponic\n \nБоядисано в бамбуков мотив чрез металически бои.\n\nЗабележете как оръжейната майсторка Юкако е използвала дървото от АК-47, за да подчертае своята зелена тематика… Но не се заблуждавайте, „Хидропониката“ е красива и смъртоносна като самата природа — Имоджен, търговец на оръжие по време на обучение" },
	["hy_bamboo_jungle_ink"] = { name = "Бамбукова щампа", desc = "Bamboo Print\n \nУкрасено посредством хидрографика на нарисуван с четка бамбук.\n\nТук трябва да изстреляте някаква игрословица" },
	["hy_bamboo_jungle_black"] = { name = "Бамбукова сянка", desc = "Bamboo Shadow\n \nУкрасено посредством хидрографика на нарисуван с четка бамбук.\n\nКотаро загуби своя син от това оръжие… и един ден ще го използва, за да спре виновника" },
	["hy_bamboo_jungle"] = { name = "Бамбукова гора", desc = "Bamboo Forest\n \nУкрасено посредством хидрографика на нарисуван с четка бамбук.\n\nВсе още смятам, че трябва да има панда — Буут, търговец на оръжия" },
