	["hy_geometric_steps"] = { name = "Геометрични стъпки", desc = "Geo Steps\n \nУкрасено посредством хидрографика в геометричен мотив." },
	["hy_geometric_steps_green"] = { name = "Контра-тераса", desc = "Counter Terrace\n \nУкрасено посредством хидрографика в геометричен мотив.\n\nХей, Сабри, ти би трябва да вземеш това… шумно е като теб — Кармен Косинеро, спасителен експерт" },
