	["hy_kimono_diamonds_red"] = { name = "Пурпурно кимоно", desc = "Crimson Kimono\n \nУкрасено посредством хидрографика в геометричен мотив.\n\nТърнър, всеки може да бъде пречупен просто е необходимо прилагането на достатъчно натиск — „Предателят и търсачът на истина“, част II" },
