	["cu_m4a4_evil_daimyo"] = { name = "Зъл даймьо", desc = "Evil Daimyo\n \nБоядисано с персонализиран графичен дизайн в червено и черно.\n\nКармен, открих го… — „Они и Валкирията“, част I" },
	["cu_mp7_nemsis"] = { name = "Възмездие", desc = "Nemesis\n \nБоядисано с персонализирано изображение на метално чудовище.\n\nТо идва за теб" },
	["am_mp9_nitrogen"] = { name = "Рубинена отровна стрела", desc = "Ruby Poison Dart\n \nБоядисано с червени и виолетови металически бои върху черна основа.\n\nКой казва, че диамантите са най-добрият приятел на жените?" },
	["cu_negev_annihilator"] = { name = "Гръмогласен", desc = "Loudmouth\n \nБоядисано с персонализиран чудовищен дизайн, а след това умишлено занемарено.\n\nВърни се тук, на теб говоря!" },
	["cu_nova_ranger"] = { name = "Лесничей", desc = "Ranger\n \nУкрасено посредством хидрографика от рязко нанесени с четка линии и подчертано чрез топлинно приложени щампи.\n\nНякой следи ли резултата?" },
	["aq_p2000_boom"] = { name = "Пищов", desc = "Handgun\n \nБоядисано с персонализирано нарисувана ръка, правеща жест на прицелване.\n\nДотук бяхме със забавните игрички" },
	["cu_ump45_uproar"] = { name = "Бунт", desc = "Riot\n \nУкрасено посредством комбинация от хидрографики и топлинно приложени щампи.\n\nАко не искахте косвени жертви, може би трябваше да сте по-конкретни… — Хавиер Алвисо, Юмрукът на „Феникс“" },
	["cu_usp_progressiv"] = { name = "Усукване", desc = "Torque\n \nБоядисано с персонализиран модерен дизайн в черно-бяло и жълто.\n\nМанипулират те, Котаро. И ако не го виждаш, значи си загазил повече, отколкото можеш да си представиш… — Феликс Райли, команден офицер" },
	["cu_ak47_winter_sport"] = { name = "Сноубордистки номер", desc = "Frontside Misty\n \nБоядисано в жизнени арктически цветове.\n\nОбичам да работя в снега… накрая винаги се получава красива картина — Хавиер Алвисо, Юмрукът на „Феникс“" },
	["cu_dualberretta_dragons"] = { name = "Двойни дракони", desc = "Dualing Dragons\n \nИма лазерно гравирани дракони на плъзгача и цевта.\n\nМериан винаги е била по-готина от Силвия" },
	["cu_famas_lenta"] = { name = "Последният оцелял", desc = "Survivor Z\n \nЩамповано чрез самозалепваща лента, а след това умишлено занемарено.\n\nКакво е бяло, червено и стреля в напълно автоматичен режим?" },
	["gs_g3sg1_flux_purple"] = { name = "Поток", desc = "Flux\n \nБоядисано с лилави и сребристи металически бои.\n\nПланът е списък от неща, които не се изпълняват" },
	["gs_galil_nightwing"] = { name = "Студенo като камък", desc = "Stone Cold\n \nПодчертано е чрез синя металическа боя. Прикладът и пълнителят носят знака на дизайнера.\n\nВ крайна сметка ще трябва да излезеш от сянката на наставника си" },
	["gs_glock18_wrathys"] = { name = "Привидения", desc = "Wraiths\n \nБоядисано с персонализирани изображения на изгубени души по плъзгача.\n\nПърво прониква през булото на нощта, а после и в сенките" },
	["gs_m249_nebula_crusader"] = { name = "Междузвезден кръстоносец", desc = "Nebula Crusader\n \nБоядисано в персонализиран вид, така че да изглежда като класическа аркадна игра.\n\nМожете да го използвате, но първо трябва да пуснете монета" },
	["gs_m4a1s_snakebite_gold"] = { name = "Златна намотка", desc = "Golden Coil\n \nУкрасено посредством хидрографика на атакуваща змия.\n\nУсойницата може да нападне отвсякъде" },
	["cu_mac10_alekhya_duo"] = { name = "Шарения", desc = "Rangeen\n \nБоядисано с персонализиран древноиндийски мотив.\n\nМожете ли да се опълчите на гневния му взор?" },
	["cu_mag7_myrcene"] = { name = "Кобалтово ядро", desc = "Cobalt Core\n \nБоядисано с персонализиран футуристичен графичен дизайн.\n\nПази го в безопасност, Кармен — „Валкирията и любовника“, част I" },
	["cu_mp7_classified"] = { name = "Специална доставка", desc = "Special Delivery\n \nБоядисано в — ЗАЛИЧЕНО —\n\nАко направя това, което искате, ще ме пуснете ли? — „Фениксът и разказвачът“, част II" },
	["hy_p250_crackshot"] = { name = "Окрилен изстрел", desc = "Wingshot\n \nУкрасено посредством персонализирана жизнена хидрографика.\n\nПонякога е нужно фино побутване, за да получиш това, което искаш — Франц Крийгелд, тактик на „Феникс“" },
	["gs_scar20_peacemaker03"] = { name = "Зелен пехотинец", desc = "Green Marine\n \nПридадена е камуфлажна шарка, изрисувана с металическа боя.\n\nСлушайте хора… Изаки и Косинеро може да не са с нас в момент, но мисията си остава същата: ще спасим Алекс Кинкайд — Феликс Райли, команден офицер" },
	["cu_ssg08_technicality"] = { name = "Голямо желязо", desc = "Big Iron\n \nУкрасено посредством персонализирана хидрографика в жълто и оранжево, а след това умишлено леко занемарено.\n\nПобедата, дори и на косъм, пак е победа — Рона Сабри, изгряваща звезда" },
	["cu_usp_kill_confirmed"] = { name = "Потвърдено убийство", desc = "Kill Confirmed\n \nБоядисано с персонализирано изображение на куршум, разбиващ череп.\n\n2 в гръдния кош, 1 в главата" },
	["aq_xm1014_scumbria"] = { name = "Пушена херинга", desc = "Scumbria\n \nФино боядисано с металически бои.\n\nДа не прибързваме. Може би има и друг начин да привлечем вниманието на Валерия — „Бащина любов“, част III" },
	["cu_ak47_point_disarray"] = { name = "Точка на безпорядък", desc = "Point Disarray\n \nУкрасено посредством персонализирана геометрична хидрографика.\n\nОтблизо е хаос… От разстояние е красота — Франц Крийгелд, тактик на „Феникс“" },
	["am_aug_jumble"] = { name = "Рикошет", desc = "Ricochet\n \nБоядисано в шарка с персонализиран дизайн от два преплетени цвята.\n\nКотаро не се нуждае от защитата ни — „Валкирията и любовника“, част I" },
	["cu_bizon_noxious"] = { name = "Горивен елемент", desc = "Fuel Rod\n \nБоядисано в персонализиран вид, така че да създаде илюзията за облъчени муниции.\n\nПонякога лакеите вземат надмощие" },
	["aq_deagle_corinthian"] = { name = "Коринтски", desc = "Corinthian\n \nЛазерно гравирано с придадена персонализиран кожен захват.\n\nЗащита. Надежда. Доверие. Упорство." },
	["cu_fiveseven_retrobution"] = { name = "Ретро възмездие", desc = "Retrobution\n \nУкрасено посредством персонализирана ретро хидрографика.\n\nНякои неща никога не стават демоде" },
	["cu_g3sg1_executioner"] = { name = "Екзекуторът", desc = "The Executioner\n \nРъчно изрисувано с ужасяваща демонстрация на кости.\n\nВинаги си вземам трофей — Хавиер Алвисо, Юмрукът на „Феникс“" },
	["gs_m4a4_royal_squire"] = { name = "Кралски паладин", desc = "Royal Paladin\n \nСтарателно гравирано и боядисано, така че да се предаде усещане за величие.\n\nТози телефонен разговор не се е състоял, разбрахте ли ме? — „Паладинът и бащата“ част I" },
	["cu_negev_impact"] = { name = "Товарач", desc = "Power Loader\n \nУкрасено посредством персонализирана хидрографика, напомняща на тежкотоварни машини.\n\nСтраховит за кралиците. Обичан от епископите." },
	["am_p2000_imperial_red"] = { name = "Имперски", desc = "Imperial\n \nЛазерно гравирано и боядисано с металически червени и жълти цветове.\n\nЧувствата ми са без значение Keo, имам да защитавам цяла империя — Буут, търговец на оръжия" },
	["cu_p90_shapewood"] = { name = "Дърворезба", desc = "Shapewood\n \nДървеният приклад е ръчно резбован, шлифован и ламиниран.\n\nПинцетите не са включени" },
	["gs_sawedoff_necromancer"] = { name = "Йорик", desc = "Yorick\n \nПридадена е хидрографика с череп и ръчно изрисувани златни акценти.\n\nРозенкранц и Гилденщерн нямаха никакъв шанс…" },
	["hy_scar20_jungler"] = { name = "Заразна епидемия", desc = "Outbreak\n \nБоядисано с ярки зелени нюанси.\n\nВалерия става все по-самонадеяна… Настъпи момента да отнесем битката при нея — Феликс Райли, команден офицер" },
	["gs_sg553_tiger_moth"] = { name = "Кафява мечка", desc = "Tiger Moth\n \nБоядисано с персонализирана шарка от крилото на нощна пеперуда.\n\nВалерия става все по-самонадеяна… Настъпи момента да отнесем битката при нея — Феликс Райли, команден офицер" },
	["cu_tec9_avalanche"] = { name = "Лавина", desc = "Avalanche\n \nУкрасено с персонализирана, изтънчена и футуристична хидрографика.\n\nТрябва да сме находчиви в това как ще подходим срещу нея. Една грешна стъпка би ѝ позволила да съсипе и двама ни — „Змията и търсачът на истината“" },
	["aq_xm1014_hot_rod"] = { name = "Теклова горелка", desc = "Teclu Burner\n \nИзползвана е металическа боя, за да се добавят пламъци.\n\nПонякога бунзеновата горелка е недостатъчна…" },
	["gs_ak47_supercharged"] = { name = "Инжекцион", desc = "Fuel Injector\n \nКорпусът на автомата е боядисан в ярко жълто, а пълнителят е изрисуван с персонализирани машинни елементи.\n\nЖивейте с по четвърт пълнител във всеки миг" },
	["cu_bizon_citizen"] = { name = "Светлинна зона", desc = "Photic Zone\n \nПридадена е персонализирана камуфлажна шарка, акцентирана с флуоресцентна боя.\n\nТова, което чувате, не е плясъкът на вълните…" },
	["aq_deserteagle_kumichodragon"] = { name = "Драконът Кумичо", desc = "Kumicho Dragon\n \nИма лазерно гравирани дракони на плъзгача и захвата.\n\nАз съм голям почитател на работата Ви, Юкако, трябва да си поговорим… — Хъксли, съперничката" },
	["cu_fiveseven_augmented"] = { name = "Триумвират", desc = "Triumvirate\n \nПридадена е светлосиня хидрографика от разпокъсана цифрова шарка (DDPAT), както и персонализирано боядисан плъзгач.\n\nПечалбата ми не идва от войната, а чрез човешкото състояние… — Буут, търговец на оръжия" },
	["gs_glock18_award"] = { name = "Кралски легион", desc = "Royal Legion\n \nСтарателно гравиран.\n\nНаоми разбира, че някой ден ще умре за Валерия" },
	["gs_m4a4_pioneer"] = { name = "Бойната звезда", desc = "The Battlestar\n \nВсички ъгли от квитанцията са били отрязани при получаването на покупката.\n\nПазете се от онези, които говорят за наблюдателницата" },
	["am_mac10_electricity"] = { name = "Син алигатор", desc = "Lapis Gator\n \nПридадена е хидрографика от ярка алигаторска кожа.\n\nЛодката не е включена в комплекта" },
	["gs_mag7_praetorian"] = { name = "Преторианец", desc = "Praetorian\n \nБоядисано с отличителна металически цветове.\n\nСпиралата се заформя" },
	["sp_mp7_impire"] = { name = "Таласъмска империя", desc = "Impire\n \nПридадена е хидрографика на тълпа от таласъми.\n\nПокосяването никога не е било толкова очарователно" },
	["cu_ssg08_necropos"] = { name = "Некропос", desc = "Necropos\n \nРъчно изрисувано с нечестиви руни.\n\nВсеки дърводелец се нуждае от своя чук, всеки шивач — от своето вретено…" },
	["gs_tec9_jambiya"] = { name = "Джамбия", desc = "Jambiya\n \nРъчно изрисувано и лазерно гравирано с шарки от Средния Изток.\n\nШехерезада разказала 1 000 приказки… това е последната, която ще чуете" },
	["gs_usp_voltage"] = { name = "Оловна изолационна тръба", desc = "Lead Conduit\n \nПридаден е персонализирано гравиран заглушител и плъзгач.\n\nПолучихте това, което искате, а знаете ли какво означава това? — Буут, търговец на оръжия" },
	["cu_aug_swallows"] = { name = "Ято в строй", desc = "Fleet Flock\n \nПридадена е хидрографика на летящи птици из облаците.\n\nНякои птици олицетворяват хармонията и мира… тези не са от тях" },
	["cu_bizon_Curse"] = { name = "Възмездието на Анубис", desc = "Judgement of Anubis\n \nБоядисано с персонализиран египетски мотив.\n\nСпусъкът му е по-лек от перце" },
	["gs_cz75a_redastor"] = { name = "Червен астор", desc = "Red Astor\n \nРъчно изрисувано с червени и бели акценти.\n\nИмето на Буут се превърна в синоним на семейните драми, а кой има време за подобни неща, когато трябва да говорим делово — Хъксли, съперничката" },
	["gs_dualberettas_ventilators"] = { name = "Вентилатори", desc = "Ventilators\n \nТези пистолети са елегантно хромирани.\n\nОръжие за артисти, от артисти" },
	["sp_g3sg1_militiaorange"] = { name = "Оранжев сблъсък", desc = "Orange Crash\n \nШаблоните и оранжевият спрей са придали на тази винтовка отличителния ѝ облик.\n\nСтанете съвременния Шир Хан" },
	["gs_galilar_incenerator"] = { name = "Престрелка", desc = "Firefight\n \nПридадени са червени акценти и ръчно изрисувана икона.\n\nБуут възложи специална поръчка при изработката на това оръжие за Валерия, в опит да изглади взаимоотношенията си с „Феникс“" },
	["cu_m249_spectre"] = { name = "Привидение", desc = "Spectre\n \nБоядисано в изтънчен и съвременен вид.\n\nПредстои да започне гражданската война на „Феникс“" },
	["cu_m4a1s_soultaker"] = { name = "Огънят на Чантико", desc = "Chantico's Fire\n \nРъчно изрисувано в живи цветове с акцент на усмихнато личице върху приклада.\n\nЗащитавайте това, което е Ваше" },
	["am_mp9_bioleak"] = { name = "Биологичен разлив", desc = "Bioleak\n \nРазличните зелени нюанси създават илюзията за химически разлив.\n\nИЗБЯГВАЙТЕ ПРЯКОТО ИЗЛАГАНЕ" },
	["hy_p2000_oceani"] = { name = "Океански", desc = "Oceanic\n \nПридадена е черна основа, върху която са нанесени акценти със сини шарки.\n\nНякой да се е чувал с Котаро или Кармен? — Феликс Райли, команден офицер" },
	["cu_p250_asiimov"] = { name = "Азимов", desc = "Asiimov\n \nБоядисано с персонализиран научно фантастичен дизайн.\n\nАко мислите, че ми е нужна винтовка, за да убия някого, нямате представа с кого говорите… — Мика Битон, снайперист на „Феникс“" },
	["gs_sawedoff_fubar"] = { name = "Крах", desc = "Fubar\n \nТази добре обиграна пушка има дълбоко издялкани знаци по дулото.\n\nЗапочва се гръмко… и завършва безмълвно" },
	["cu_sg553_atlas"] = { name = "Атлас", desc = "Atlas\n \nПридадена е модерна камуфлажна хидрографика.\n\nТози дизайн някога беше предназначен за „Коалиционната експертна група“, но посредством въвличане в корпоративен шпионаж, Хъксли успя да го направи ексклузивен за „Феникс“" },
	["gs_ssg08_armacore"] = { name = "Призрачен кръстоносец", desc = "Ghost Crusader\n \nБоядисано в бяло и с придадени акценти в арктическо синьо.\n\nНикога няма да мога да заменя онова, което ни беше отнето… но мога да им отнема дори много повече — „Фениксът и посветеният“, част II" },
	["am_tec9_redblast"] = { name = "Повторно влизане", desc = "Re-Entry\n \nВърху дулото е придадена огнена щампа.\n\nМразя да съм права през цялото време — Кармен Косинеро, спасителен експерт" },
	["cu_ump45_primalsaber"] = { name = "Първобитен саблезъб", desc = "Primal Saber\n \nПридадена е щампа с череп на саблезъб тигър.\n\nВсеки хищник в крайна сметка среща своята кончина" },
	["cu_xm1014_spectrum"] = { name = "Черна вратовръзка", desc = "Black Tie\n \nЧернобялата, хромирана визия на тази пушка я прави най-удачна за употреба при официални събития.\n\nДържим Изаки и Косинеро. Нужни ли са ти за нещо или просто мога да ги убия още сега? — „Наемникът и змията“, част I" },
	["cu_lore"] = { name = "Предание", desc = "Lore\n \nБоядисано с персонализирана плетеница." },
	["cu_stonewash"] = { name = "Черен ламинат", desc = "Black Laminate\n \nПридаден е износен вид и черен ламиниран приклад." },
	["am_marbleized_g"] = { name = "Доплеров гама ефект", desc = "Gamma Doppler\n \nБоядисано с черни и сребристи металически бои чрез използване на разтворител, придаващ мраморен вид, а след това е облято в един цвят." },
	["gs_autotronic"] = { name = "Автотроник", desc = "Autotronic\n \nАнодно оксидирано в червено и е използвана стомана с решетъчна структура за облекчаване на тежестта." },
