	["cu_r8_cybersport"] = { name = "Рестартиране", desc = "Reboot\n \nУкрасено посредством червени акценти върху сребристи и черни панели.\n\n„Опитахте ли да го изключите и включите отново?“" },
	["cu_sawed_off_lime"] = { name = "В светлината на прожектора", desc = "Limelight\n \nБоядисано с персонализирани ненадейни извити линии криви в жълто-зелено и бяло.\n\nВсички очи са вперени във Вас" },
	["gs_scar20_bloodsport"] = { name = "Кървав спорт", desc = "Bloodsport\n \nПокрито с щампи на бели лога върху хидрографика в червен и черен цвят.\n\nСтраната на КТ е спонсорирана от…" },
