	["am_tec_9_sea_salt"] = { name = "Ледникова шапка", desc = "Ice Cap\n \nУкрасено посредством синьо-бяла абстрактна хидрографика.\n\nПотопете опозицията" },
	["bloodhound_black_silver"] = { name = "Овъглени", desc = "Charred\n \nИзработени от класическа черна еластична кожа.\n\nМонетите от предизвикателство са страхотни, но не пускат кръв, когато ударите някого с опакото на ръката — Кармен Косинеро, спасителен експерт" },
	["bloodhound_snakeskin_brass"] = { name = "Змийско ухапване", desc = "Snakebite\n \nИзработени с комбинация от обикновена и змийска кожа.\n\nНека бъдем честни… Сергей не липсва на никого — Ханс Крийгелд, тактик на „Феникс“" },
	["bloodhound_metallic"] = { name = "Бронзови", desc = "Bronzed\n \nКожата е боядисана в тъмно сиво и бронзово.\n\nОперация „Хрътка“ беляза края на подивелия снайперист Чейс Търнър" },
	["bloodhound_guerrilla"] = { name = "Партизански", desc = "Guerrilla\n \nНаправени чрез комбинация от естествена кафява и изкуствена кожа с камуфлажна щампа.\n\nВалерия планира да има възмездие, в това няма никакво съмнение… — Себастиен Хенекет, снайперист" },
