	["handwrap_camo_grey"] = { name = "Смърчова разпокъсана цифрова шарка", desc = "Spruce DDPAT\n \nВъншните превръзки са украсени чрез ситопечатен дизайн със сив цифров камуфлаж.\n\nНякои хора твърдят, че са издръжливи, а други го показват…" },
	["handwrap_red_slaughter"] = { name = "Клане", desc = "Slaughter\n \nТези боядисани в тъмно червено превръзки затрудняват разграничаването на това къде свършва тъканта и къде започват кървавите петна.\n\nКой не обича ръчния труд?" },
	["handwrap_fabric_orange_camo"] = { name = "Пущинаци", desc = "Badlands\n \nТази импровизирани предпазни средства за ръцете са направени от скалъпени материали.\n\nФеликс си затваря очите за непозволената боксова лига в „Коалиционната експертна група“" },
	["slick_black"] = { name = "Лунно вплитане", desc = "Lunar Weave\n \nТъмносиният велур е преплетен със смолисточерна кожа, за да се придаде непреходен външен вид на тези ръкавици.\n\nПредотвратява окървавяването на ръцете… образно казано" },
	["slick_military"] = { name = "Конвой", desc = "Convoy\n \nНаправени са с комбинация мека кафява кожа и боядисан велур.\n\nПонякога дискретността е необходима" },
	["slick_red"] = { name = "Пурпурно вплитане", desc = "Crimson Weave\n \nЧерният велур е преплетен с аленочервена кожа, за да се придаде непреходен външен вид на тези ръкавици.\n\nОставете своята следа, а не отпечатъците си" },
	["slick_snakeskin_yellow"] = { name = "Диамантена гърмяща змия", desc = "Diamondback\n \nИзработени са чрез комбинация от бежова, черна и змийска кожа.\n\nСтандартно оборудване за наивници… — Имоджен, търговец на оръжие по време на обучение" },
	["sporty_green"] = { name = "Лабиринт от жив плет", desc = "Hedge Maze\n \nТези зелено-бели ръкавици са изработени от Icarus Athletics.\n\nСамо страхливците се опасяват да летят близо до слънцето" },
	["sporty_purple"] = { name = "Кутията на Пандора", desc = "Pandora's Box\n \nТези черно-лилави ръкавици разполагат с едва доловима щампована шарка върху дланите.\n\nЗадължително пособие за всеки експерт по експлозивите с потни длани" },
	["sporty_light_blue"] = { name = "Свръхпроводник", desc = "Superconductor\n \nТези синьо-черни ръкавици са идеални за онези, които желаят да бъдат феноменални.\n\nНе си търсете белята" },
	["sporty_military"] = { name = "Суша", desc = "Arid\n \nМножеството кафяви нюанси и едва доловимата камуфлажна щампа придават на тези ръкавици отличителният им външен вид.\n\nАко ще бъдем герои, нека поне да изглеждаме като такива… — Рона Сабри, изгряваща звезда" },
	["specialist_ddpat_green_camo"] = { name = "Горска разпокъсана цифрова шарка", desc = "Forest DDPAT\n \nРъчно съшитата кожа е комбинирана с издръжлива тъкан, украсена чрез щампа на разпокъсана цифрова шарка (DDPAT).\n\nНякои хора не обичат да си цапат ръцете" },
	["specialist_kimono_diamonds_red"] = { name = "Пурпурно кимоно", desc = "Crimson Kimono\n \nНа този чифт ръкавици е придаден акцент от яркочервена диамантена шарка.\n\nПочервенейте от яд" },
	["specialist_emerald_web"] = { name = "Изумрудена паяжина", desc = "Emerald Web\n \nВърху опакото на ръкавиците е придадена паяжинна шарка.\n\nДисциплината поражда успех" },
	["specialist_white_orange_grey"] = { name = "Фундамент", desc = "Foundation\n \nНа тези черно-бели ръкавици са придадени оранжеви акценти.\n\nТвърди се, че Tortue били вдъхновени от поредицата оръжия Азимов" },
	["motorcycle_basic_black"] = { name = "Затъмнение", desc = "Eclipse\n \nТова е оригиналният класически черен дизайн, чрез който Tortue станаха известни.\n\nНе го окачествявайте като криза на средната възраст" },
	["motorcycle_mono_boom"] = { name = "Бум!", desc = "Boom!\n \nТози чифт ръкавици е покрит с възклицания от печатен комикс.\n\nБУФ! БУМ! ПРАС!" },
	["motorcycle_mint_triangle"] = { name = "Градинска мента", desc = "Spearmint\n \nБялата кожа и червените шевове правят тези ръкавици както стилни, така и удобни.\n\nЗа парите, които ни взема, Хъксли би могъл поне да хвърли и кутия с ментови бонбони… — Феликс Райли, команден офицер" },
