	["gs_AUG_Syd_Mead"] = { name = "Сид Мийд", desc = "Syd Mead\n \nПроектирано с персонализиран дизайн от прочутия творец Сид Мийд.\n\nВ миналото, той ни предостави проникновение за бъдещето. В настоящето, постави бъдещето в ръцете ни…" },
