	["aq_Five_Seven_Scumbria"] = { name = "Пушена херинга", desc = "Scumbria\n \nДискретно боядисано с райета.\n\nФеликс, не можеш да го оставиш да умре… Трябва да го спасиш — „Дъщерята и паладинът“, част I" },
