	["cu_Glock18_Weasel"] = { name = "Невестулка", desc = "Weasel\n \nПридадена е хидрографика на пакостливата невестулка Боби. Не закачайте Боби.\n\nПросто защото е сладък, не означава, че не хапе" },
	["cu_MAG7_Tribal"] = { name = "Петроглиф", desc = "Petroglyph\n \nБоядисано в персонализиран вид, така че да създаде илюзията за скални рисунки.\n\nРазмириците съществуват още откакто първият пещерняк се е научил как да хваща камък… — Буут, търговец на оръжия" },
	["cu_MP9_Narcis"] = { name = "Въздушен люк", desc = "Airlock\n \nБоядисано в бяло и с придаден яркочервен пълнител.\n\nПерфектно за разстрелване на тостери" },
	["hy_Negev_Dazzle"] = { name = "Поразително", desc = "Dazzle\n \nПокрито с щампи на бели и сини райета наподобяващи шарката на зебра.\n\nНай-сетне, оръжие за любителите на незначителни факти" },
	["cu_P90_Grimm"] = { name = "Зловещо", desc = "Grim\n \nПридадена е хидрографика от убийствени привидения, след което е боядисано в зелени акценти със „суха“ четка.\n\nИмоджен… Оръжие ли ми продаваш или плакат с ултравиолетова щампа? — Рона Сабри, изгряваща звезда" },
	["gs_SCAR20_Powercore"] = { name = "Захранващо ядро", desc = "Powercore\n \nБоядисано в персонализиран зелен цвят с жълти акценти, след което е придаден USB код за бързо разплащане.\n\nПравило № 1 — Предизвикателството изисква удовлетворение" },
	["cu_SG556_Triarch"] = { name = "Триарх", desc = "Triarch\n \nТази винтовка била поръчана от кралска особа и има придаден пустинен камуфлаж.\n\nНапомнете им за любовта Ви" },
	["gs_TEC9_Supercharged"] = { name = "Инжекцион", desc = "Fuel Injector\n \nТялото е боядисано в жълто, а на пълнителя е придадена хидрографика, изобразяваща двигателни ремъци. Ръчно изработена кожен захват завършва тази Сиатълска класика.\n\nМонтажният екип не е включен" },
	["cu_UMP45_Metritera"] = { name = "Инструктаж", desc = "Briefing\n \nПридадена е хидрографика на топографска карта.\n\nТова ще е кратко съвещание…" },
	["hy_XM1014_Fractal_Blue"] = { name = "Хиперпространство", desc = "Slipstream\n \nБоядисано в персонализирано тъмносиво и яркосиньо.\n\nТърпение, Елиът. Те все още имат своята роля… — „Наемникът и змията“, част II" },
	["am_czv2_mf"] = { name = "Полимер", desc = "Polymer\n \nНа плъзгача е придадена щампа, която наподобява полимерна формула.\n\nВече не си имате работа с „Феникс“, ние знаем как да се грижим за своите хора… — „Дъщерята и паладинът“, част II" },
	["aq_glock_dark-fall"] = { name = "Желязна художествена творба", desc = "Ironwork\n \nПлъзгачът е лазерно гравиран, за да изобразява трънлив бръшлян.\n\nАко бъде оставена на самотек, всяка градина се превръща в плетеница от плевели" },
	["cu_ssg08_dragonfire_scope"] = { name = "Драконов огън", desc = "Dragonfire\n \nПридадена е хидрографика от чудовищен огнедишащ дракон.\n\nНастанете се върху своето съкровище и зачакайте някой, който би дръзнал да го отнеме" },
	["gs_dual_berettas_golden_venice"] = { name = "Кралски консорти", desc = "Royal Consorts\n \nЧрез оцветените в зелено перлени ръкохватки около пластините с грифони на дръжката и лазерно гравирания плъзгач, тези пистолети предефинират елегантността.\n\nИзправете се лице в лице със своя враг и пуснете гълъбите" },
	["gs_famas_mecha"] = { name = "Механическа промишленост", desc = "Mecha Industries\n \nЯркият черно-бял дизайн го прави да изглежда така сякаш е дошло от някое научнофантастично предаване.\n\nЩръкналата синя коса и съпътстващия робот не са включени в комплекта" },
	["gs_final_pooldeadv2"] = { name = "Перест облак", desc = "Cirrus\n \nБоядисано с металически син цвят и е придадена щампа на череп.\n\nСпрете да витаете из облаците" },
