	["aa_hide-mp9"] = { name = "Пясъчен обгар", desc = "Sand Scale\n \nБоядисано с персонализирана окраска от сиво и жълтеникавокафяво.\n\nТрябва да се подготвим за отмъщение — Феликс Райли, команден офицер" },
