	["gs_p90_shallow_grave"] = { name = "Плитък гроб", desc = "Shallow Grave\n \nЗахватите са боядисани така, че да наподобяват камъни с руни, а върху приклад е приложена хидрографика на скелет.\n\nКато се има предвид количеството трупове, които оставяш след себе си, на кого ще му се занимава да копае?" },
	["cu_usp_cyrex"] = { name = "Сайрекс", desc = "Cyrex\n \nПридадени са дискретни червени акценти, които придават футуристично усещане.\n\nИмоджен живееше в миналото, Феликс. Аз съм бъдещето — Хъксли, съперничката" },
