	["sp_knots_blue"] = { name = "Нощен Бор", desc = "Night Borre\n \nБоядисано със спрей чрез синя шарка от сключени пръстени, вдъхновена от норвежки мотив.\n\n„По-добре е да се сражавате и да бъдете покосени, отколкото да живеете без надежда“" },
