	["cu_ak47_aztec"] = { name = "Неизследвано", desc = "Uncharted\n \nПриложено е персонализирано боядисване от разнообразни племенни шарки.\n\nСподеляме същото кану" },
	["cu_five_seven_angry"] = { name = "Разярена тълпа", desc = "Angry Mob\n \nПриложено е персонализирано боядисване с ярки цветове, вдъхновено от улични творби.\n\n„На ум, моля“" },
	["cu_awp_viper"] = { name = "Усойница", desc = "Atheris\n \nРъчно изрисувано в поразителна зелено-синя дървесна усойница върху черна основа.\n\nТолкова смъртоносна, колкото и красива" },
	["cu_tec9_bamboo"] = { name = "Баламосване", desc = "Bamboozle\n \nПриложено е персонализирано боядисване наподобяващо бамбук.\n\nНе се заблуждавайте" },
	["gs_mac10_fish_bait"] = { name = "Бяла риба", desc = "Whitefish\n \nРъчно изрисувано с рибешки люспи, кости и куки в бяло върху черна основа.\n\nУловете и умрете" },
	["gs_deagle_exo"] = { name = "Теснолинейка", desc = "Light Rail\n \nПриложено е персонализирано боядисване, което създава оптична илюзия и изглежда променя геометрията на оръжието.\n\nНеобходимото захранване се продава отделно" },
