	["cu_revolver_oppressor"] = { name = "Черепотрошач", desc = "Skull Crusher\n \nРъчно изрисувано с жълти пламъци и червено-бели акценти.\n\n„Отворете шииииироко“" },
	["gs_m4a4_emperor"] = { name = "Императорът", desc = "The Emperor\n \nБоядисано с персонализиран облик на император, използвайки вдъхновение от съответната таро карта.\n\nПоведете с глава, дори ако значи да игнорирате сърцето си" },
	["cu_aug_momentum"] = { name = "Инерция", desc = "Momentum\n \nБоядисано с персонализирани ярки цветове и сочещи напред стрелки.\n\nВинаги се движи напред" },
	["gs_mp5sd_astromatic"] = { name = "Гаус", desc = "Gauss\n \nБоядисано в персонализиран вид, така че да изглежда сякаш е сглобено от парчета пресована стомана.\n\nЛюбящо наричано „SpaceGat 2000“" },
	["cu_mp7_racketeer"] = { name = "Пакостник", desc = "Mischief\n \nИзрисувана е обезпокоителна черно-бяла усмивка върху червена основа.\n\nНадали ще е за добро" },
	["aq_p250_verdigris"] = { name = "Зелен меден окис", desc = "Verdigris\n \nЗелените утечки са в резултат от медна основа, изложена на влиянието на атмосферните условия.\n\nОт въздуха, който дишате" },
	["cu_p90_offworld"] = { name = "Отвъдно", desc = "Off World\n \nРъчно изрисувано с множество слоя от синя боя. Дори повече от последния път.\n\nТози най-горен слой може никога да не изсъхне…" },
	["cu_xm1014_incinerator"] = { name = "Инсинелигатор", desc = "Incinegator\n \nПриложено е персонализирано боядисване, наподобяващо огнедишащ алигатор.\n\nБум. Бам. Буф… Бадум." },
	["aa_ump45_moonrise_sunset"] = { name = "Лунен изгрев", desc = "Moonrise\n \nПроизволният градски пейзаж в предния план отстъпва на пълнолунието и лилаво-червено нощно небе.\n\nТърсете северна полярна звезда" },
	["cu_bizon_road_warrior"] = { name = "Ембарго", desc = "Embargo\n \nСглобено от намерени предмети, разполагащо със синкавозелена основа и разнообразни реклами от Хавана през 1950 години.\n\nЧао до скив!" },
	["gs_ak47_nibbler"] = { name = "Таратайка", desc = "Rat Rod\n \nВъзвърнато от пустинно бунище, оригиналният му син горен слой е пребоядисан, върху него е драскано и е износен с течение на времето.\n\nНяма къде да бягате" },
	["cu_aug_whitefang"] = { name = "Арктически вълк", desc = "Arctic Wolf\n \nПриложено е персонализирано боядисване, което наподобява бялата козина на арктически вълк.\n\nВсеки рунд е 1 срещу 5" },
	["cu_awp_virus"] = { name = "Изолационен пробив", desc = "Containment Breach\n \nБоядисано в персонализиран вид, така че да изобразява мутирали плъхове, опитващи да избягат от радиоактивна, неоновозелена гора.\n\nКой знае какви радиоактивни болести пренасят…" },
	["gs_mp5_etch"] = { name = "Киселинно размиване", desc = "Acid Wash\n \nПреди сглобяването, синият металически горен слой е бил изложен на киселина. Придаден е завършек с месингов хардуер.\n\nЧерно, синьо и месинг отвсякъде" },
	["gs_tec9_decimator"] = { name = "Погубващия", desc = "Decimator\n \nБоядисано в персонализирани напълно радикални сини и розови акценти.\n\nДостъпно за 4 лесни платежни вноски от 124,95 $!" },
	["cu_nova_featherswing"] = { name = "Перушина", desc = "Plume\n \nПерсонализирано боядисани кафяви, наслояващи се върху дървена цевна кутия и приклад.\n\nТова би трябвало да разроши нечии пера" },
	["cu_g3sg1_blacksand"] = { name = "Черен пясък", desc = "Black Sand\n \nБоядисано с персонализирана жълто-кафява и черна военна камуфлажна шарка.\n\nСпециалният отряд от „Коалиционната експертна група“ печелеше, ето защо Мика Батън се обърна към по-агресивен подход…" },
	["gs_r8_memento"] = { name = "Спомен", desc = "Memento\n \nЛуксът на слоновата кост за захвата се съчетава добре със сложната металургична изработка върху рамката, цевта и барабана.\n\nДий!" },
	["cu_mp7_replica"] = { name = "Неонов пласт", desc = "Neon Ply\n \nЛаминирано и изпълнено с всеки възможен въобразим неонов цвят.\n\n„Рой Дж. Бив? Нищо не ми говори.“" },
	["cu_p2000_obsidian"] = { name = "Обсидиан", desc = "Obsidian\n \nБоядисано в персонализиран вид, така че да изглежда сякаш е потопено в лава и се втвърдява в обсидиан, докато се охлажда.\n\nДавайки съвсем ново значение на термина „стъклено оръдие“" },
