	["sp_scar20_striker_dust"] = { name = "Разкъсано", desc = "Torn\n \nБоядисано със спрей в шарка от произволни райета.\n\nНа парчета…" },
	["cu_sg553_reactor"] = { name = "Колония IV", desc = "Colony IV\n \nРъчно изрисувано със скелетоподобна червена мравка над противогази и поток от оранжево-жълто.\n\nСтанете част от техния свят" },
	["gs_mac10_stalker"] = { name = "Дебнещ", desc = "Stalker\n \nБоядисано с персонализирана синя котка и райета в жълто и черно.\n\nМац, пис-пис…" },
	["cu_ssg08_tickler"] = { name = "Кървясало", desc = "Bloodshot\n \nБоядисано персонализирано с нещо чудовищно, състоящо се от зелени пипала, зъби и една очна ябълка.\n\nЗа да Ви виждам по-добре" },
	["gs_m249_warbird_veteran"] = { name = "Бойна птичка", desc = "Warbird\n \nПървоначално с топлинен щит в синьо и жълто, възрастта и употребата са взели своя дан върху външния му вид.\n\nТази стара птичка заслужава да си почине" },
	["aq_m249_aztec"] = { name = "Ацтек", desc = "Aztec\n \nНамерено при разкопки на ацтекски руини, части от този M249 са ръждясали и са били покрити с мъх.\n\nНикога не се доверявайте на въжен мост" },
	["gs_dual_elites_classic"] = { name = "Елит 1.6", desc = "Elite 1.6\n \nВърху страните на тези класически два Beretta е щамповано „ELITE“ („ЕЛИТ“).\n\nМатериал от първоизточника" },
	["cu_famas_nuke_tension"] = { name = "Извадено от употреба", desc = "Decommissioned\n \nТова персонализирано боядисване е вдъхновено от елементи намиращи се на de_nuke от Counter-Strike 1.6.\n\nАко бъде намерено, моля, върнете го в атомна електроцентрала „Сидър Крийк“" },
	["cu_tec9_flash"] = { name = "Светкавично заслепяване", desc = "Flash Out\n \nБоядисано в персонализиран вид, така че да наподобява заслепяваща граната.\n\nОтговор: Танцови уроци с Джордан" },
	["cu_fiveseven_gsg9"] = { name = "Дружка", desc = "Buddy\n \nБоядисано с персонализирани камуфлажни шарки и КТ под задния мерник.\n\nЩе Ви пазя гърба" },
	["gs_p250_inferno"] = { name = "Пъкъл", desc = "Inferno\n \nПриложено е персонализирано боядисване, което отразява характера на de_inferno.\n\n„Но вижте колко късно стана!“" },
	["gs_mac10_dust_crate"] = { name = "Класически сандък", desc = "Classic Crate\n \nРъчно изрисувано, така че да наподобява зелените метални сандъци, първоначално намиращи се на de_dust2.\n\nЩурмувайте „B“, без да спирате" },
	["gs_mag7_popdog"] = { name = "Popdog", desc = "Popdog\n \nБоядисано в персонализиран вид, така че да наподобява вагон с надписа „Pop Dog“, нарисуван отстрани.\n\nКучето, което освежава!" },
	["cu_mp9_hydra"] = { name = "Хидра", desc = "Hydra\n \nПриложено е персонализирано боядисване, позоваващо се на операция „Хидра“. VIII такава в CS:GO.\n\nЗаслужаваше си чакането" },
	["cu_p90_nostalgia"] = { name = "Носталгия", desc = "Nostalgia\n \nБоядисано с персонализиран КТ от главното меню в оригиналния Counter-Strike.\n\nМинути за инсталация, но цял живот за усвояване" },
	["am_aug_death_by_doggy"] = { name = "Смърт чрез пале", desc = "Death by Puppy\n \nПриложена е многоцветна „Pop Dog“ шарка.\n\nНе бива да се бърка със „стълба“" },
	["cu_scar_assault"] = { name = "Нападение", desc = "Assault\n \nЛогото на научноизследователско съоръжение е ръчно изрисувано в бяло върху синя основа.\n\nСъщо достъпно в червено" },
