	["cu_ump_bomb"] = { name = "Пластичен експлозив", desc = "Plastique\n \nПриложено е персонализирано боядисване от жици, зелена платка и циферблат.\n\n73556**" },
	["cu_awp_wildfire"] = { name = "Опустошителен огън", desc = "Wildfire\n \nЛогото на операция „Опустошителен огън“ е ръчно изрисувано върху основа от черно и червено.\n\nГвоздеят, който стърчи, ще бъде ударен от чука" },
	["cu_glock_hero"] = { name = "Саможертва", desc = "Sacrifice\n \nТова персонализирано боядисване отдава почит на пламенното обезвреждане от olofmeister на Overpass през ESL One Cologne 2014.\n\n„Скоро ще обезвреди… Все още го прави!“" },
	["gs_famas_legacy_gold"] = { name = "Честване", desc = "Commemoration\n \nБоядисано в персонализиран златен цвят и включва разнообразни детайли ознаменуващи 20 години от Counter-Strike.\n\nЕто за още 20" },
	["gs_ak47_gold_arabesque"] = { name = "Златна арабеска", desc = "Gold Arabesque\n \nРъчно изрисувано със заплетен дизайн върху приклада и ръкохватката. Металът е боядисан в златисто с филигранни акценти.\n\n„Какви други трикове се крият в ръкава на Буут?“" },
