	["hy_brush_camo_tan"] = { name = "Пустинен щрих", desc = "Desert Brush\n \nПриложена е хидрографика с шарка в пясъчен цвят.\n\nИзпитание за ефективността на камуфлажа, версия 1." },
	["hy_ddpat_urban_red"] = { name = "Червена разпокъсана цифрова шарка", desc = "Red DDPAT\n \nУкрасено посредством хидрографика в червена разпокъсана цифрова шарка (DDPAT).\n\nДокато се доближите достатъчно, за да забележите пикселите, вече ще е прекалено късно" },
	["hy_dry_wood"] = { name = "Загнило дърво", desc = "Spalted Wood\n \nПриложена е хидрографика с шарка, наподобяваща изсъхнало дърво.\n\nДа чукнем на дърво, ще Ви е нужен всичкия възможен късмет — Феликс Райли, команден офицер" },
	["hy_desert_multicam"] = { name = "Черно и жълто-кафяво", desc = "Black & Tan\n \nПриложена е хидрографика с множество камуфлажни шарки в черен и жълто-кафяв цвят.\n\nНе можете да пропуснете, ако не стреляте" },
	["hy_torn_camo_paints"] = { name = "Плаващ пясък", desc = "Quick Sand\n \nПриложена е хидрографика с шарка в син и жълто-кафяв цвят върху приклада и цевната кутия. Дулото е боядисано в тъмно синьо.\n\n„Радост за очите“ би било меко казано" },
	["sp_moro_carving_lightblue"] = { name = "Нови корени", desc = "New Roots\n \nБоядисано със спрей чрез шарка от лози и цветя в разнообразни зелени нюанси.\n\nПространство за израстване" },
