	["sp_moro_textile_purple_yellow"] = { name = "Повехнала лоза", desc = "Withered Vine\n \nБоядисано със спрей чрез шарка от цветя в лилаво и златисто.\n\nНякои хора виждат досада, а аз — красота" },
	["sp_palm_night"] = { name = "Среднощна палма", desc = "Midnight Palm\n \nБоядисано със спрей в черни палмови листа върху камуфлаж в сиво и лилаво.\n\n„Табелата гласи затворено!“" },
