	["am_ddpat_purple"] = { name = "Лилава разпокъсана цифрова шарка", desc = "Purple DDPAT\n \nУкрасено посредством хидрографика в червена разпокъсана цифрова шарка (DDPAT).\n\nДокато се доближите достатъчно, за да забележите пикселите, вече ще е прекалено късно" },
	["gs_awp_hydra"] = { name = "Пустинна хидра", desc = "Desert Hydra\n \nПерсонализирано боядисани златни змии, пълзящи към дулото на този AWP. Оптиката, дулото и задната част на приклада са боядисани в бяло.\n\nОтрязването на една глава означава, че се появяват още две… Готови ли сте да поемете този риск? — Валерия Дженър, революционерка" },
	["gs_deagle_fennec"] = { name = "Фенек лисица", desc = "Fennec Fox\n \nБоядисано с персонализирана фенек лисица върху дулото. Захватът включва синкавозелени и оранжеви дизайни.\n\nЗа да те чувам по-добре" },
