	["am_navy_shine"] = { name = "Тъмносин гланц", desc = "Navy Sheen\n \nПриложена е тъмносиня анодно оксидирана шарка от променлив камуфлаж.\n\nЗащо сте толкова унили?" },
	["gs_aug_sand_storm"] = { name = "Пясъчна буря", desc = "Sand Storm\n \nПриложено е персонализирано боядисване, изобразяващо преминаваща пясъчна буря под нощното небе.\n\nКрасотата е навсякъде около нас, просто трябва да знаете къде да гледате" },
	["sp_dry_wood"] = { name = "Плаващи трупи", desc = "Drift Wood\n \nБоядисано със спрей, ползвайки кафяв цвят в шарка, наподобяваща изсъхнало дърво.\n\nДа чукнем на дърво, ще Ви е нужен всичкия възможен късмет — Феликс Райли, команден офицер" },
	["sp_desert_skulls_dawn"] = { name = "Суша", desc = "Drought\n \nБоядисано със спрей в шарка от животински черепи.\n\nОстава само това" },
	["sp_mirage_flowers_tan"] = { name = "Охрена дамаска", desc = "Sienna Damask\n \nБоядисано със спрей чрез шарка от дамаска на цветя връз основата на оръжието в жълто-кафяв цвят.\n\nТехнически, най-добрите камуфлажи са онези, които не забелязвате…" },
	["sp_moro_carving_burnt"] = { name = "Овлажнител", desc = "Humidor\n \nБоядисано със спрей чрез шарка от лози и цветя в кафяво и лилаво.\n\n„Какво държат там вътре?“" },
