	["gs_mp5_neon_flektarn"] = { name = "Оксиден оазис", desc = "Oxide Oasis\n \nПриложена е шарка с камуфлаж в ярки оранжеви и жълто-кафяви цветове. На оръжието е придаден е завършек със златисти акценти.\n\nДадено толкова тихо оръжие не бива да е толкова шумно" },
	["aa_desert_bloom_bright"] = { name = "Пустинен разцвет", desc = "Desert Blossom\n \nБоядисано със спрей в ярки цветя връз суха, напукана основа.\n\nПриродата винаги побеждава" },
	["hy_lizard_skin"] = { name = "Анолис", desc = "Anolis\n \nПриложена е хидрографика с люспеста гущерова шарка в зелено и черно.\n\nБоядисано в люспеста скала" },
	["cu_ak-47_phantom_disruptor"] = { name = "Фантомен разрушител", desc = "Phantom Disruptor\n \nБоядисано персонализирано с мъгляво подобно илюзорно създание върху матова черна основа.\n\n„Може да бъде каквото си иска, където си иска, и при все това избира да пребивава с Вас…“" },
	["gs_aug_thunderstorm"] = { name = "Котката Том", desc = "Tom Cat\n \nПридаден е завършек със златисти акценти, сочещи назад стрелки и пакостливо изглеждаща котка върху основа от метална сплав.\n\nГръмотевичните бури са мъркането на природата" },
	["cu_awp_vein"] = { name = "Капиляр", desc = "Capillary\n \nПриложено е персонализирано боядисване, съставено от заплетени синкавозелен и оранжеви вени.\n\nКлючът към сърцето на даден агент струва 4 750 $" },
	["cu_cz75_cerakote"] = { name = "Занемарено", desc = "Distressed\n \nПридаденият завършек от медно оцветеното керамично покритие се износва с течение на използването.\n\nСтава по-добро с течение на времето" },
	["cu_deagle_replica"] = { name = "Син пласт", desc = "Blue Ply\n \nЛаминирано и изпълнено със захват в пепеляв цвят и син плъзгач.\n\nПРЕДУПРЕЖДЕНИЕ: Това е репродукция и не е била тествана с бойни боеприпаси" },
