	["cu_mac10_nacre"] = { name = "Диско техника", desc = "Disco Tech\n \nБоядисано персонализирано, използвайки перлено гланцов завършек, така че да наподобява холограмен, самозалепващ се винил. В зависимост от светлината външният му вид се променя.\n\nВнимавайте, когато се целите с това нещо" },
	["gs_mag7_justice"] = { name = "Правосъдие", desc = "Justice\n \nБоядисано персонализирано, използвайки вдъхновение от таро картата „Правосъдие“.\n\nВъзмездие за всички" },
	["cu_mp5_desert_strike"] = { name = "Пустинно нападение", desc = "Desert Strike\n \nБоядисано с персонализиран високотехнологичен дизайн в жълто-кафяво и черно.\n\nНападайте първи! Така ще сте последните нанесли нападение" },
	["cu_negev_prototype"] = { name = "Прототип", desc = "Prototype\n \nБоядисано персонализирано в бяло и червено. Това е временно боядисване, докато се финализира дизайна.\n\nВерсия 1.2.1, ПАТЕНТ № 3422107" },
	["aq_p2000_acid_clover"] = { name = "Киселинно гравирано", desc = "Acid Etched\n \nПриложена е произволна многоцветна шарка с рядка четирилистна детелина.\n\nЧувствате ли се късметлии?" },
	["gs_r8_leviathan"] = { name = "Изковано от кости", desc = "Bone Forged\n \nЗахватът на този револвер е боядисан персонализирано с останките на антична морска твар.\n\nКакво се таи в дълбините" },
	["cu_sawedoff_apocalypto"] = { name = "Апокалипто", desc = "Apocalypto\n \nБоядисано персонализирано с разлагаща се ръка, протягаща се към планета, наподобяваща бомба, върху лилав фон на открития космос.\n\n„Имате ли малко време?“" },
	["gs_scar20_enforcer"] = { name = "Правоприлагащ изпълнител", desc = "Enforcer\n \nЩателно е рисуван градиентен залез върху различни части от оръжието.\n\nАвтоматични решения от КОРПОРАЦИЯ ЗА СИМЕТРИЧНИ УМНИ ОРЪЖИЯ" },
	["cu_sg553_darkwing"] = { name = "Мрачно крило", desc = "Darkwing\n \nПерсонализирано боядисано с приложени пера и други мрачни детайли в червени и черни цветове.\n\nОрлов поглед и изключително смъртоносно. Надали ще намерите по-опасна птица, която не може да лети" },
	["cu_ssg08_fever_dream"] = { name = "Трескав сън", desc = "Fever Dream\n \nБоядисано с персонализирано маниакални розови, сини и лилави рисунки върху черна основа.\n\nХ@@ХХ@Х@Х@ХА!!" },
	["cu_glock18_warmaiden"] = { name = "Куршумена кралица", desc = "Bullet Queen\n \nБоядисано с персонализирани заплашителни куршуми и военна девица в розово яке върху основа от жълто и черно.\n\n„Ще спра да стрелям, когато Вие почнете да мълчите“" },
	["cu_negev_ultralight"] = { name = "Свръх светлина", desc = "Ultralight\n \nБоядисано с персонализирана сива дигитална камуфлажна шарка и синкавозелени стрелки.\n\nИмате ли огънче?" },
	["cu_ak47_anubis"] = { name = "Легион на Анубис", desc = "Legion of Anubis\n \nПриложено е персонализирано боядисване включващо египетските богове Анубис и Ра, представляващи баланса между живота и смъртта.\n\nНека наклони везните във Ваша полза" },
	["aq_p2000_lost_world"] = { name = "Съковит", desc = "Gnarled\n \nИзкривено извънземно същество, простиращо се от захвата до плъзгача на този ръчно рисуван пистолет P2000.\n\nОт мрачните кътчета на безграничната бездна" },
	["cu_mag7_monster_call"] = { name = "Чудовищен повик", desc = "Monster Call\n \nБоядисано с персонализирана синя основа и подводни създания на преден план.\n\nВинаги има по-голяма, по-зелена риба" },
	["cu_printstream"] = { name = "Печатен поток", desc = "Printstream\n \nБоядисано с персонализиран ярък черно-бял дизайн и акценти с перлено гланцов завършек.\n\nБЯЛО_1; ЧЕРНО_1; ПЕРЛЕНО_ГЛАНЦОВ_ЗАВЪРШЕК_1;" },
	["cu_glock_eyecontact"] = { name = "Модно", desc = "Vogue\n \nЧифт очи красят плъзгача на този Glock с персонализирано боядисване, вдъхновено от популярното художествено творчество.\n\n„Гледайте ме, докато стрелям по Вас!“" },
	["gs_tec9_guerilla"] = { name = "Събрат", desc = "Brother\n \nБоядисано с персонализирани кафяви и златни камуфлажни шарки и агент от страна на Т под задния мерник.\n\nЩе ни пазя задниците" },
	["cu_mac10_isoonna"] = { name = "Примамливост", desc = "Allure\n \nПерсонализирано боядисана жена в синкавозелено, считана за исо онна (磯女 — iso onna — „жената от плажната скала“), стояща пред брокатен шаран и бушуващи вълни върху този MAC-10.\n\nКрасотата поражда кръвопролития" },
	["gs_sg553_rusty"] = { name = "Старата ръждавейка", desc = "Ol' Rusty\n \nВлагата е променила външния вид на първоначално полираната стомана на това оръжие. Върху корпуса над спусъка е щамповано „Ol' Rusty“ („Старата ръждавейка“).\n\nРъждив, но доверен приятел" },
	["cu_ssg08_mainframe"] = { name = "Мейнфрейм 001", desc = "Mainframe 001\n \nПриложено е високотехнологично персонализирано боядисване в синьо и лилаво.\n\nКакви тайния се крият зад _001?" },
	["cu_p250_cassette"] = { name = "Касетка", desc = "Cassette\n \nПриложено е персонализирано боядисване, вдъхновено от опаковката на видеокасета от '90.\n\nПроверете лентата" },
	["gs_p90_container"] = { name = "Товарен вагон", desc = "Freight\n \nПерсонализираното боядисване наподобява товарен вагон, покрит с графити.\n\nИзкуството не е вандализъм" },
	["cu_xm1014_amulet_blue"] = { name = "Погребан", desc = "Entombed\n \nЛежала в гробница от хилядолетия насам, тази наскоро открита XM-1014 пушка е персонализирано боядисана със сини превръзки и египетски акценти.\n\nПодходящо за фараон" },
	["cu_m4a4_queenfairy"] = { name = "Феята на зъбките", desc = "Tooth Fairy\n \nПриложено е персонализирано боядисване, изобразяващо резци, кътници и смразяваща интерпретация на феята на зъбките.\n\nНикой не е казал, че зъбите трябва да са Ваши…" },
	["gs_galil_phoenix"] = { name = "Свръзка", desc = "Connexion\n \nЛогата на фракцията „Феникс“ са боядисани със спрей върху основата в бяло и червено.\n\nНосят тежката артилерия" },
	["gs_bizon_hellraider"] = { name = "Руническо", desc = "Runic\n \nТова персонализирано боядисване включва руни с неизвестен произход и пълнител, който наподобява картечница „Гатлинг“.\n\nДайте им да разберат" },
	["gs_mp5sd_wasteland_legacy"] = { name = "Доизпипване", desc = "Kitbash\n \n20 години от проектиране на MP5 допринесоха за това персонализирано боядисване, крепящо се с изолирбанд, свински опашки и лепило.\n\nАко не успеете от първия (и втория… и третия…) път…" },
	["gs_awp_exoskeleton"] = { name = "Екзоскелет", desc = "Exoskeleton\n \nМеталът на този AWP е напечатан със заплетени шарки на взаимно преплитащи се черепи.\n\n\nС всичка сила" },
	["gs_cz75_vendetta"] = { name = "Вендета", desc = "Vendetta\n \nПрез годините по него е гравирано, рисувано и закалено с употреба.\n\nОт вкочанените ми, мъртви ръце" },
	["hy_p90_dino_rampage"] = { name = "Какаово развилняване", desc = "Cocoa Rampage\n \nПриложена е хидрографика с шарка от анимационни динозаври, оцветена в маслиненозелено и златисто.\n\nДинозаври, извънземни и комети, леле-мале!" },
	["gs_dual_elites_dezastre"] = { name = "Dezastre", desc = "Dezastre\n \nБоядисано с персонализиран високотехнологичен дизайн в черно, бяло и червено.\n\nВинаги следвайте насоките на производителя за безопасна употреба" },
	["cu_five_seven_diary"] = { name = "Приказка", desc = "Fairy Tale\n \nБоядисано с персонализирани изображения на принцеса, еднорози, красиви цветя и замък в далечината.\n\n„Днес ще е хубав ден. Просто го усещам“" },
	["gs_g3sg1_disrupt"] = { name = "Дигитална мрежа", desc = "Digital Mesh\n \nБоядисано с персонализирано оцветена разпокъсана цифрова шарка (DDPAT) в червено, бяло и тъмносиво.\n\nРазстройващо заплетено" },
	["gs_galil_vandal"] = { name = "Вандал", desc = "Vandal\n \nЗелената му основа е била покрита с разпокъсани бели рисунки.\n\nВсяка рисунка разказва история, но някои са по-паметни от други" },
	["cu_p250_infect"] = { name = "Замърсител", desc = "Contaminant\n \nГорното покритие от бордо е било постепенно разядено, оставяйки западащо оръжие с ограничени останали употреби.\n\nЗле е само толкова, колкото изглежда" },
	["cu_m249_deep_relief"] = { name = "Дълбок релеф", desc = "Deep Relief\n \nГорният слой с пясъчен цвят отстъпва пред по-тъмните зелени нюанси, колкото по-надълбоко отивате. Персонализирано боядисване, което можете да усетите.\n\nКолко куршума, за да се стигне до центъра?" },
	["cu_m4a4_cyberpunk"] = { name = "Киберсигурност", desc = "Cyber Security\n \nБоядисано с персонализирани диагонални линии в синьо, червено и златисто върху черната основа на това M4.\n\nВЕЧЕ ДОСТЪПНО ПРИ МЕСТНИЯ ВИ ДОСТАВЧИК НА КИБЕРНЕТИКА" },
	["gs_mp5_conditionzero"] = { name = "Нулево условие", desc = "Condition Zero\n \nПерсонализираното боядисване в синьо и жълто отдава почит на Counter-Strike: Condition Zero.\n\n„РПГ на три часа! Избягвайте!“" },
	["cu_nova_polymer"] = { name = "Ясен полимер", desc = "Clear Polymer\n \nБоядисано в персонализиран вид, така че да изглежда сякаш рамката е прозрачна, позволявайки Ви да виждате вътре в оръжието.\n\nЦелите Ви са ясни" },
	["cu_glock_noir"] = { name = "Нео-ноар", desc = "Neo-Noir\n \nБоядисано с персонализирана стилизирана синьо пурпурна жена върху сив фон.\n\n„Ситуацията започваше да взема обрат и тя почна да изпитва надежда, а след това погледна нагоре“" },
	["cu_ssg08_chromatic"] = { name = "Паралакс", desc = "Parallax\n \nЦветовете в това персонализирано боядисване са приложени в изместени позиции, водещи до смайващ изглед.\n\nСтреляйте два пъти, убивайте веднъж" },
	["gs_ump_gold_bismuth"] = { name = "Златист бисмут", desc = "Gold Bismuth\n \nМежду бяла и черна основа е поставена шарка от златист бисмут.\n\n„Имате скъп вкус…“" },
	["cu_usp_krokos"] = { name = "Чудовищна смесица", desc = "Monster Mashup\n \nПриложено е персонализирано боядисване включващо зелено чудовище и други икони, вдъхновени от популярно градско художествено изкуство. Заглушителят разполага с перлено гланцов завършек.\n\nX__X" },
	["cu_csgo_camo"] = { name = "Глобална офанзива", desc = "Global Offensive\n \nБоядисано с персонализиран син, жълт и сив камуфлаж.\n\n„Ще осъществим първи контакт в Харц, Германия в 17:25 по Гринуич +1.…“" },
	["am_authority_brown"] = { name = "Харта", desc = "Charter\n \nПриложена е шарка в жълто-кафяв цвят от гербове, писания с неразбираем почерк и текст от „Великата харта на свободите“.\n\nСледва всеки да има право на справедлив процес — дори и Вие" },
	["hy_authority_purple"] = { name = "Велика харта", desc = "Magna Carta\n \nПриложена е шарка в лилав цвят от гербове, писания с неразбираем почерк и текст от „Великата харта на свободите“.\n\nСледва всеки да има право на справедлив процес — дори и Вие" },
	["am_intelligence_grey"] = { name = "Наблюдение", desc = "Surveillance\n \nПриложено е персонализирано боядисване с шарка на карта, насложена с проекционен дисплей от птичи поглед.\n\nЦелта е прихваната" },
	["am_intelligence_orange"] = { name = "Засечена заплаха", desc = "Threat Detected\n \nПриложено е персонализирано боядисване с шарка на карта, насложена с проекционен дисплей от птичи поглед.\n\nЦелта е прихваната" },
	["am_intelligence_magenta"] = { name = "Целта е прихваната", desc = "Target Acquired\n \nПриложено е персонализирано боядисване с шарка на карта, насложена с проекционен дисплей от птичи поглед.\n\nЦелта е прихваната" },
	["am_numbers_bronze"] = { name = "Бронзът", desc = "The Bronze\n \nПриложена е многоцветна шарка с произволни числа.\n\nЧислата не лъжат, но аз го правя" },
	["am_numbers_red_blue"] = { name = "Диспечер", desc = "Dispatch\n \nПриложена е многоцветна шарка с произволни числа.\n\nЧислата не лъжат, но аз го правя" },
	["hy_numbers_green"] = { name = "Превключвателно табло", desc = "Switch Board\n \nПриложена е многоцветна шарка с произволни числа.\n\nЧислата не лъжат, но аз го правя" },
	["am_numbers_magenta"] = { name = "Първична конспирация", desc = "Prime Conspiracy\n \nПриложена е многоцветна шарка с произволни числа.\n\nЧислата не лъжат, но аз го правя" },
	["aa_fade_red_blue"] = { name = "Боровинки и череши", desc = "Berries And Cherries\n \nПлъзгачът е боядисан наполовина в червено и синьо.\n\nУуууп-уууп!" },
	["cu_ump_crime_scene"] = { name = "Местопрестъпление", desc = "Crime Scene\n \nБоядисано с персонализирана жълта предупредителна лента върху основа в червено и синьо.\n\nРазчистете района, имаме работа за вършене…" },
	["am_m4a1s_bluesmoke"] = { name = "Син фосфор", desc = "Blue Phosphor\n \nМножество слоеве от металическа синя боя са били приложени върху хромираната синя основа.\n\nМеланхолични ли сте?" },
	["cu_ak_xray"] = { name = "Рентген", desc = "X-Ray\n \nПерсонализирано боядисан AK-47 с вътрешните елементи на показ чрез рентгенова снимка.\n\nКогато всичко е разкрито, възможно е да не харесате онова, което виждате…" },
	["am_heist_plans_green"] = { name = "Обир", desc = "Heist\n \nОсновата му е боядисана с бежово анодно оксидирана шарка на карта. Изглежда така сякаш някой е рисувал върху картата, откакто тя е била приложена за пръв път.\n\nПланирането е едно нещо, изпълнението е друго" },
	["am_heist_plans_purple"] = { name = "Нощен обир", desc = "Night Heist\n \nОсновата му е боядисана с лилаво анодно оксидирана шарка на карта. Изглежда така сякаш някой е рисувал върху картата, откакто тя е била приложена за пръв път.\n\nПланирането е едно нещо, изпълнението е друго" },
	["am_heist_plans_yellow"] = { name = "Обир на трезор", desc = "Vault Heist\n \nОсновата му е боядисана със сиво анодно оксидирана шарка на карта. Изглежда така сякаш някой е рисувал върху картата, откакто тя е била приложена за пръв път.\n\nПланирането е едно нещо, изпълнението е друго" },
	["hy_houndstooth_brown"] = { name = "Патешка стъпка", desc = "Houndstooth\n \nПриложена е хидрографика с кафява шарка в стил „патешка стъпка“.\n\nЕкипирайте се за ролята, която искате. А не онази, с която разполагате" },
	["gs_mac10_snake"] = { name = "Горещи змии", desc = "Hot Snakes\n \nБоядисано с персонализирана шарка на бронзова змийска кожа и навита змия под телта от приклада.\n\nСвистенето е от куршумите, прелитащи покрай Вас" },
	["hy_phoenix_tags_lilac"] = { name = "„Феникс“ тебешир", desc = "Phoenix Chalk\n \nПриложена е многоцветна шарка от разнообразни графити на „Свръзката „Феникс“.\n\n„Глупци сте, ако мислите, че ще победите!“" },
	["am_phoenix_tags_blue"] = { name = "„Феникс“ маркер", desc = "Phoenix Marker\n \nПриложена е многоцветна шарка от разнообразни графити на „Свръзката „Феникс“.\n\n„Вече не могат да ни спрат!“" },
	["hy_phoenix_tags_red"] = { name = "„Феникс“ шаблон", desc = "Phoenix Stencil\n \nПриложена е многоцветна шарка от разнообразни графити на „Свръзката „Феникс“.\n\n„Не можем да бъдем убити!“" },
	["sp_phoenix_tags_purple"] = { name = "„Феникс“ ултравиолетова светлина", desc = "Phoenix Blacklight\n \nПриложена е многоцветна шарка от разнообразни графити на „Свръзката „Феникс“.\n\n„Ще танцуваме върху гробовете Ви!“" },
	["hy_tigers_tan"] = { name = "Глинена засада", desc = "Clay Ambush\n \nПриложена е хидрографика с тигрова шарка в кафяво и жълто-кафяво.\n\nОбичайно самостоятелни хищници, ще направят изключение за Вас" },
	["am_tigers_brown"] = { name = "Тигров ров", desc = "Tiger Pit\n \nПриложена е хидрографика с тигрова шарка в кафяво и жълто-кафяво върху черна основа.\n\nКъдето и да е само не и тук." },
	["am_tigers_blue"] = { name = "Копринен тигър", desc = "Silk Tiger\n \nПриложена е хидрографика с тигрова шарка върху синя основа.\n\nНационално съкровище… Тигърът, а не AWP" },
	["cu_m4a1_snake"] = { name = "Добре дошли в джунглата", desc = "Welcome to the Jungle\n \nТова персонализирано боядисване включва антична иконография и златна гърмяща змия върху полумрачно обагрен джунглов фон.\n\nНападайте без предупреждение" },
	["cu_ak_jaguar"] = { name = "Ягуар", desc = "Panthera onca\n \nДървото на приклада и ръкохватката се отличават с красиви резби, често отвличащи вниманието от персонализирано боядисания ягуар отстрани.\n\nКой казва, че не можете да си мените шарката?" },
	["cu_jaguar_p90"] = { name = "Бягайте и се скрийте", desc = "Run and Hide\n \nБоядисано с персонализирана шарка на ягуар и завършек от набраздена кожа.\n\nВсеки може да си проправи път с пари в модата, но малцина притежават истински стил" },
	["aa_ancient_brown"] = { name = "Антична Земя", desc = "Ancient Earth\n \nПриложена е шарка в кафяво и златисто включваща сложно изписани линии и антични създания.\n\nПривилегията е Ваша" },
	["am_ancient_warm"] = { name = "Антична ерудиция", desc = "Ancient Lore\n \nПриложена е бледо зелена, бежова и червена шарка от антични плочици.\n\n„Надеждата остава, дори за онези, които са започнали своето пътуване, поемайки по грешния път“" },
	["aa_ruins_green"] = { name = "Тучно обрасли руини", desc = "Lush Ruins\n \nВъв фона на тази шарка, украсена с растителност, са прикрити антични богове.\n\n„Всички да се оглеждат — наблюдават ни…“" },
	["hy_ancient_tiles_peach"] = { name = "Проблясък от миналото", desc = "Blast From the Past\n \nПриложена е бледо зелена и бежова шарка от антични плочици.\n\n„Надеждата остава, дори за онези, които са започнали своето пътуване, поемайки по грешния път“" },
	["am_gold_brick"] = { name = "Златно кюлче", desc = "Gold Brick\n \nЗлатистото му покритие блещука на светлината, отличавайки всяко красиво несъвършенство върху оръжието.\n\nВсичкият този блясък…" },
	["sp_ancient_bright"] = { name = "Антични видения", desc = "Ancient Visions\n \nПриложена е шарка в зелено и червено включваща сложно изписани линии и антични създания.\n\nПривилегията е Ваша" },
	["hy_ruins_red"] = { name = "Сумрачни руини", desc = "Dusk Ruins\n \nВъв фона на тази шарка, украсена с растителност, са прикрити антични богове.\n\n„Всички да се оглеждат — наблюдават ни…“" },
	["am_jade"] = { name = "Издялан нефрит", desc = "Carved Jade\n \nБоядисано в прозиращ нефритено зелен слой с анодно оксидиран ефект върху хромирана основа.\n\nНай-изтънченото сред по-изнтънчените неща" },
	["am_ancient_wine"] = { name = "Античен ритуал", desc = "Ancient Ritual\n \nПриложена е шарка в кестеняво и сребристо включваща сложно изписани линии и антични създания.\n\nПривилегията е Ваша" },
	["hy_drywood_green"] = { name = "Висока трева", desc = "Tall Grass\n \nПриложена е хидрографика с шарка от зелена трева.\n\nВъв високата трева никога не се случва нищо добро" },
	["am_black_panther"] = { name = "Пантероподобен камуфлаж", desc = "Panther Camo\n \nПриложен е завършек с петънца, наподобяващи черна пантера.\n\nНамерете своето сенчесто местенце" },
	["gs_ak47_professional"] = { name = "Плоча", desc = "Slate\n \nПриложено е персонализирано боядисване, което може да бъде описано само като „черно върху черно върху черна плоча“.\n\n„Извикайте лекар, ще им е нужен“" },
	["cu_cz75_whirlwind"] = { name = "Орел змияр", desc = "Circaetus\n \nБоядисано персонализирано с хищна птица, носеща змия, върху този CZ75.\n\nЗмиеядец, но без лесно запомнящата се мелодия на тематичната песен" },
	["cu_mp9_food_chain"] = { name = "Хранителна верига", desc = "Food Chain\n \nТози ярко оцветен MP9 е боядисан с персонализирана чудовищна хранителна верига.\n\nЯжте или ще бъдете изядени" },
	["cu_galil_chroma_pink"] = { name = "Хроматична аберация", desc = "Chromatic Aberration\n \nЦветовете в това персонализирано боядисване са приложени в изместени позиции, водещи до смайващ изглед.\n\n(Не особено) благо за очите…" },
	["gs_glock_polymer"] = { name = "Прозиращ полимер", desc = "Clear Polymer\n \nБоядисано с жълто-кафяв плъзгач и син спусък. Рамката е направена от прозиращ полимер.\n\nПолучавате това, което виждате." },
	["gs_usps_hangedman"] = { name = "Изменникът", desc = "The Traitor\n \nБоядисано персонализирано, използвайки вдъхновение от таро картата „Обесник“.\n\nПредходните неуспехи са проекти за бъдещи успехи" },
	["cu_m4a4_love"] = { name = "Жизнени цветове", desc = "In Living Color\n \nБоядисано персонализирано, използвайки неонови цветове и покрито с ръчно изрисувани дизайни.\n\nСражавайте се за един, сражавайте се за всички" },
	["gs_m249_combine"] = { name = "С.Е.И.В.С.", desc = "O.S.I.P.R.\n \nТози M249 е боядисан персонализирано в сива метална сплав и придаден е завършек с интеграторско лого.\n\nСтандартна екипировъчна импулсна винтовка на „Съгледвачи“" },
	["cu_negev_devtexture"] = { name = "Текстура_за_разработка", desc = "dev_texture\n \nБоядисано с персонализирана основа в оранжеви и сиви текстури за разработчици.\n\nВреме е за hammer.exe" },
	["gs_p250_cybershell"] = { name = "Кибер броня", desc = "Cyber Shell\n \nБоядисано с персонализиран сребърен плъзгач и захват с текстура от шестоъгълници.\n\nВие представлявате фронтовата линия на полаганите от нас усилия за киберсигурност" },
	["cu_mac10_portable"] = { name = "Блъскане по бутоните", desc = "Button Masher\n \nБоядисано в персонализиран вид, така че да наподобява геймпад и разнообрази бутони, подаващи се през прозираща полимерна обвивка.\n\nПридавайки напълно ново значение на фразата „конзолни войни“" },
	["aq_xm1014_punk"] = { name = "ХОХО", desc = "XOXO\n \nПриложена е шарка в ярки цветове, вдъхновена от пънкарски мотив.\n\nДа, бе, да…" },
	["gs_r8_rustking"] = { name = "Бунище", desc = "Junk Yard\n \nСинята основа на този револвер е покрита със сребристи писания и рисунки. Барабанът и предният мерник са боядисани в червено.\n\nДостойно за крал" },
	["gs_sg553_deathmetal"] = { name = "Хеви метъл", desc = "Heavy Metal\n \nЧерната основа е боядисана с оранжеви и жълти акценти. Върху задната част на приклада са нарисувани три звезди.\n\n„Едно от тези копчета е турбо бутонът, но просто не мога да си спомня кое…“" },
	["am_ump45_electrowave"] = { name = "Осцилатор", desc = "Oscillator\n \nПридаден е завършек с произволна шарка в оранжево, черно и сиво.\n\nВсеки има точка на пречупване. Къде е Вашата?" },
	["cu_deag_trigger_discipline"] = { name = "Дисциплина на спусъка", desc = "Ziggy\n \nБоядисано с розова персонализирана изометрична шарка върху цевта. Ударникът и предният мерник са боядисани в светло синьо.\n\nТърпението е награда само по себе си" },
	["sp_nova_wind_dispersal"] = { name = "Отнесено от вихъра", desc = "Windblown\n \nБоядисано със спрей в произволна шарка на поле от глухарчета.\n\nРазкарайте се от моравата ми" },
	["am_nuclear_pattern4_famas"] = { name = "Срив", desc = "Meltdown\n \nБоядисано с шарка от символи за ядрена опасност чрез металически бои.\n\nСтойте надалеч за известно време…" },
	["aa_spacerace_orange"] = { name = "Космическа надпревара", desc = "Space Race\n \nПриложена е тематична космическа шарка, състояща се от звезди и сателити.\n\nИзпращане и получаване" },
	["sp_spacerace_blue"] = { name = "Спътник", desc = "Sputnik\n \nПриложена е тематична космическа шарка, състояща се от звезди и сателити.\n\nИзпращане и получаване" },
	["sp_technowar_red"] = { name = "Шипящ ПУКОТ", desc = "Fizzy POP\n \nПриложена е шарка в жълто-кафяво и червено, вдъхновена от ретро техника.\n\nВойните се печелят с информация" },
	["hy_technowar_rwb"] = { name = "AWP ПУКОТ", desc = "POP AWP\n \nПриложена е шарка в бяло, червено и синьо, вдъхновена от ретро техника.\n\nВойните се печелят с информация" },
	["hy_trainarchitect_green"] = { name = "Пролетен фасон", desc = "Spring Twilly\n \nПриложена е хидрографика с шарка от подбрани дизайни в черно и зелено.\n\nПоследен шанс, влакът тръгва от гарата" },
	["hy_trainarchitect"] = { name = "Есенен фасон", desc = "Autumn Twilly\n \nПриложена е хидрографика с шарка от подбрани дизайни в червено и жълто-кафяво.\n\nПоследен шанс, влакът тръгва от гарата" },
	["gs_m4a4_coalition"] = { name = "Коалицията", desc = "The Coalition\n \nПриложено е персонализирано боядисване в златисто и черно с взаимосвързани триъгълници и сини акценти.\n\nТози съюз е временен, но ще ме накарате да го преосмисля…" },
	["cu_mac10_propaganda"] = { name = "Пропаганда", desc = "Propaganda\n \nБоядисано с персонализиран чифт очи и разнообразни думи на руски, включващи „контрол“ и „страх“.\n\nНе им вярваш, нали?" },
	["gs_train_cz75"] = { name = "Синдикат", desc = "Syndicate\n \nПриложено е персонализирано боядисване в златисто и черно с взаимосвързани триъгълници и сини акценти.\n\nДействаме заедно" },
	["hy_ak47lam_green"] = { name = "Зелен ламинат", desc = "Green Laminate\n \nПриложен е зелен ламинат върху приклада, захвата и ръкохватката на този AK.\n\nПростичките неща…" },
	["sp_galil_caution"] = { name = "ВНИМАНИЕ!", desc = "CAUTION!\n \nБоядисано със спрей чрез високо контрастни шеврони в черно и жълто.\n\nНамерете утеха в това да се чувствате неловко" },
	["hy_geometric_steps_pearl"] = { name = "Тераса призма", desc = "Prism Terrace\n \nПриложена е перлено гланцова шарка на оптична илюзия.\n\nКъде почва и къде свършва? Въобще има ли край?" },
	["gs_m4a1_vertigo"] = { name = "Непосредствена опасност", desc = "Imminent Danger\n \nПриложено е персонализирано боядисване от многоцветни табели за безопасност.\n\nНе казвайте, че не съм Ви предупредил… — Буут, търговец на оръжия" },
	["hy_vertigogeo"] = { name = "Схема", desc = "Schematic\n \nПриложена е многоцветна шарка от изометрична мрежа.\n\nВие помните болката, а аз — победата" },
	["hy_vertigospray_blue"] = { name = "Стратегии", desc = "Strats\n \nПриложена е хидрографска шарка от строителния план на 51 етаж, включващ климатичната инсталация и окабеляването.\n\nВсичко е според плана…" },
