	["hy_vertigoillusion_yellow"] = { name = "Сключване", desc = "Interlock\n \nПриложена е хидрографска шарка на оптична илюзия в жълто и синьо.\n\nУспяхте ли да погледнете добре?" },
	["hy_vertigospray"] = { name = "Инфраструктура", desc = "Infrastructure\n \nПриложена е хидрографска шарка от строителния план на 51 етаж, включващ климатичната инсталация и окабеляването.\n\nВсичко е според плана…" },
	["aa_vertigogeo_neon"] = { name = "Дигитален архитект", desc = "Digital Architect\n \nПриложена е многоцветна шарка от изометрична мрежа.\n\nВие помните болката, а аз — победата" },
	["cu_sg553_caution"] = { name = "Плащане на вредни", desc = "Hazard Pay\n \nБоядисано с персонализирана жълта основа и оранжеви акценти от пътен конус.\n\nУдарете го през просото с един подир друг куршум" },
	["aa_wiring"] = { name = "Табло с прекъсвачи", desc = "Breaker Box\n \nПриложена е анодно оксидирана шарка от електромонтажна схема на окабеляване.\n\nМоля, консултирайте се с електротехник, преди да проведете самостоятелни поправки" },
	["aa_wiring_yellow"] = { name = "Неизправно окабеляване", desc = "Faulty Wiring\n \nПриложена е шарка от електромонтажна схема на окабеляване.\n\nМоля, консултирайте се с електротехник, преди да проведете самостоятелни поправки" },
	["sp_engine_dirty"] = { name = "Смяна на маслото", desc = "Oil Change\n \nБоядисано със спрей в шарка от двигателни компоненти.\n\n„Не изглежда добре…“" },
	["aa_engine_performance"] = { name = "Механизъм", desc = "Mechanism\n \nПриложена е анодно оксидирана шарка от двигателни компоненти.\n\n„Не изглежда добре…“" },
	["cu_vertigo_fiveseven"] = { name = "Риск от падане", desc = "Fall Hazard\n \nПриложено е многоцветно персонализирано боядисване, което гласи „ПАДАНЕ“ и „СТРОИТЕЛЕН ОБЕКТ“.\n\nВнимавайте с процепа" },
	["sp_tire_tread_red"] = { name = "Червена гума", desc = "Red Tire\n \nБоядисано със спрей чрез шарка от грайфер на гума в черно и червено.\n\nЗавъртете гумите" },
	["sp_tire_tread_blue"] = { name = "Синя гума", desc = "Blue Tire\n \nБоядисано със спрей чрез шарка от грайфер на гума в черно и синьо.\n\nЗавъртете гумите" },
	["gs_ak47_abstract"] = { name = "Елитен музей", desc = "Leet Museo\n \nБоядисано с персонализирано изображение на терористите от „Елитното подразделение“, промъкващи се по дългия пък към зоната за бомба „A“ на Dust II, в стила на кубизма.\n\n„Всичко, което можете да си представите, е реално“" },
	["gs_aug_plague"] = { name = "Чума", desc = "Plague\n \nБоядисано персонализирано, използвайки вдъхновение от мрачни фантазии и ужаси.\n\n„Като молец към пламък“" },
	["gs_mag7_bismuth"] = { name = "Bi83 спектър", desc = "BI83 Spectrum\n \nБоядисано в персонализиран вид, така че да наподобява дъгоцветни бисмутови кристали.\n\nЗащо най-редките неща са най-красивите?" },
	["cu_deagle_kitch"] = { name = "Океанска крайбрежна алея", desc = "Ocean Drive\n \nБоядисано персонализирано, използвайки свръхнаситени цветове и различни форми.\n\nНяма пропуск — както що се отнася до цветовете, така и когато използвате оръжието" },
	["gs_dual_berettas_tread"] = { name = "Грайфер", desc = "Tread\n \nИ двете Berettas са ръчно гравирани, използвайки вълнообразна шарка. Плъзгачите са боядисани в златисто.\n\nФините детайли отнемат най-дълго, добавят най-много и се забелязват най-малко" },
	["cu_famas_spectron"] = { name = "Зед Екс Спектрон", desc = "ZX Spectron\n \nТова персонализирано боядисване използва вдъхновение от някогашните игрални компютри. Придаден е завършек с многоцветни акценти върху черната му основа.\n\nКлайв би се гордял" },
	["gs_five_seven_efusion"] = { name = "Протокол за подсилване", desc = "Boost Protocol\n \nБоядисано персонализирано, използвайки висококонтрастни цветове. Иконата на робота под задния мерник съответства на художественото творчество на плъзгача.\n\nПОЗИВНА: МЕХА 0272" },
	["aa_mp9_fuji_pink"] = { name = "Планината Фуджи", desc = "Mount Fuji\n \nПриложена е акрилна картина на планината Фуджи при залез-слънце. Картината е използвана като шарка, така че е възможно всяко оръжие да изглежда различно.\n\nЧервеното слънце изгрява" },
	["cu_g3sg1_tacticalmap"] = { name = "Държане под око", desc = "Keeping Tabs\n \nБоядисано персонализирано, използвайки вдъхновение от тактическото изобразяване на картата на „Опасна зона“.\n\nРазполагате с всичката нужна информация — Франц Крийгелд, тактик на „Феникс“" },
	["cu_mp7_khaki"] = { name = "Партизанска горила", desc = "Guerrilla\n \nТова персонализирано боядисване включва зелена основа, детайли в черно и гледаща напред маймуна.\n\nЛъвът никога не е бил кралят на джунглата" },
	["gs_m4_flowers"] = { name = "Паякообразна лилия", desc = "Spider Lily\n \nБоядисано с персонализирана тъмносиня основа и червени паякообразни лилии над пълнителя и спусъка.\n\nЯрките цветове са предупреждение, а не покана" },
	["cu_mac10_toybox"] = { name = "Кутия за играчки", desc = "Toybox\n \nТова персонализирано боядисване включва ярко оцветени рисунки на пилета, извънземни, клещи за обезвреждане и още други.\n\nРазчистете си бъркотията" },
	["gs_bizon_flasher"] = { name = "Лумен", desc = "Lumen\n \nБоядисано персонализирано в черно с червени акценти. Пълнителят е боядисан, така че да наподобява фенерче.\n\nОсветете пътя" },
	["cu_glock_snackattack"] = { name = "Нападателно похапване", desc = "Snack Attack\n \nБоядисано в персонализиран вид, така че да наподобява дрънкулки на нездравословна храна, висящи в смола.\n\nПохапването, което отвръща на удара" },
