	["cu_poly_green_galil"] = { name = "НВ", desc = "NV\n \nБоядисано с персонализирана тъмносива основа, завършено със зелени акценти.\n\nПритъмняване" },
	["ht_facet_p2000"] = { name = "Полутоново коралово", desc = "Coral Halftone\n \nБоядисано с персонализирана шарка, използвайки многоцветни полутонове.\n\nВнимавайте с тона" },
	["cu_chevron_scar20"] = { name = "Диви боровинки", desc = "Wild Berry\n \nБоядисано с персонализиран дизайн, използвайки многоцветни полутонове.\n\n„Не мога да се прицеля“" },
	["gs_happy_red_sg556"] = { name = "Покритие от малиново желе", desc = "Berry Gel Coat\n \nБоядисано с персонализирана металическа бронзова основа, завършено с червени акценти.\n\n„Ауу, вижте го това мъниче“" },
	["cu_graphic_overlay_ak47"] = { name = "Плавно преливане", desc = "Crossfade\n \nБоядисано с персонализиран многоцветен графичен дизайн.\n\nУловени между кадрите" },
	["ht_shapes"] = { name = "Полутоново изместване", desc = "Halftone Shift\n \nБоядисано с персонализиран дизайн, използвайки многоцветни полутонове.\n\n„Това е от зоологическа градина, но вместо животни на показ е изложено изкуство“" },
	["cu_abstract_white_cz"] = { name = "Слалом", desc = "Slalom\n \nБоядисано с персонализиран многоцветен абстрактен дизайн.\n\nЧерно диамантено оръжие" },
	["cu_poly_violet_p90"] = { name = "Вектор за атака", desc = "Attack Vector\n \nБоядисано с персонализиран многоцветен абстрактен дизайн.\n\nАгресивни ъгли на атака" },
	["soo_polysoup_m4a4"] = { name = "Полигонова супа", desc = "Polysoup\n \nБоядисано с персонализиран многоцветни кристали и акценти с перлено гланцов завършек.\n\nНедейте да увирате много" },
	["cu_glitter_deagle"] = { name = "Звезднаркада", desc = "Starcade\n \nБоядисано с персонализиран абстрактен дизайн, използвайки боя с метални люспици.\n\nНов висок резултат!" },
	["gs_lilpig_aug"] = { name = "Мъничко прасенце", desc = "Lil' Pig\n \nТова персонализирано боядисване включва червена основа и металически златисти акценти. Добавено е червено прасе близо до приклада.\n\nУ дома на стрелбището" },
	["gs_independe_awp"] = { name = "CMYK цветови модел", desc = "CMYK\n \nБоядисано с персонализиран многоцветен абстрактен дизайн върху бяла основа.\n\nЗнаех си, че ще се върнеш, но просто не очаквах да е толкова скоро… — Буут, търговец на оръжия" },
	["sp_nukestripe"] = { name = "sp_nukestripe", desc = "Nuclear Threat\n \nRadiation Hazard\n \nFallout Warning\n \nIrradiated Alert\n \nБоядисано със спрей чрез предупредителни фигури за радиационна опасност." },
	["sp_spray_waves_bravo"] = { name = "sp_spray_waves_bravo", desc = "Wave Spray\n \nТози сувенир от Seaside е боядисан със спрей чрез ръчно рисувани къси, плътни линии в контрастни цветове.\n\nПерфектно за бунтовниците в движение" },
	["hy_ocean_bravo"] = { name = "hy_ocean_bravo", desc = "Bright Water\n \nТози сувенир от Seaside е украсен посредством синя камуфлажна хидрографика.\n\nСветът ни е интригуващ, но понякога целта на камуфлажа е да бъде видян — Буут, търговец на оръжия" },
	["sp_spitfire_famas_bravo"] = { name = "sp_spitfire_famas_bravo", desc = "Spitfire\n \nТози сувенир от Cache е украсен с уста на акула в стил, наподобяващ рисунките по носовете на бойни самолети.\n\nДжестър е мъртъв" },
	["hy_tile_bravo"] = { name = "hy_tile_bravo", desc = "Mosaico\n \nТози сувенир от Ali е украсен с мозаична хидрографика.\n\nТърпението е добродетел" },
	["an_navy_bravo"] = { name = "an_navy_bravo", desc = "Anodized Navy\n \nТози сувенир от Ali е боядисан в прозиращ тъмносин слой с анодно оксидиран ефект върху хромирана основа.\n\nВече загубих един от хората си, заради лъжите на Валерия… не възнамерявам да губя повече — Феликс Райли, команден офицер" },
	["sp_hazard_bravo"] = { name = "sp_hazard_bravo", desc = "Hazard\n \nТози сувенир от Siege е боядисан със спрей в шарка от жълто-черни предупредителни линии.\n\nНЕ ПРЕМИНАВАЙ" },
	["sp_tape_dots_bravo"] = { name = "sp_tape_dots_bravo", desc = "Dry Season\n \nТози сувенир от Gwalior е боядисан със спрей чрез разкъсани парчета лента и перфориран метал, ползвани като шаблони.\n\nНе се притеснявайте… работата скоро ще потръгне — Буут, търговец на оръжия" },
	["sp_palm_bravo"] = { name = "sp_palm_bravo", desc = "Palm\n \nТози сувенир от Gwalior е боядисан със спрей чрез изрезки от картон, фина мрежа и палмови листа, ползвани като шаблони.\n\nКрасотата днес… е само пепел утре" },
	["hy_ddpat_bravo"] = { name = "hy_ddpat_bravo", desc = "Forest DDPAT\n \nТози сувенир от Ruins е украсен посредством хидрографика от разпокъсана цифрова шарка (DDPAT).\n\nДори и да не го виждате, определено ще го чуете" },
	["so_jungle_bravo"] = { name = "so_jungle_bravo", desc = "Jungle\n \nНякои отделни части на този сувенир от Ruins са плътно боядисани със спрей в цветова схема „джунгла“.\n\nЗа онези, които жадуват разрухата" },
	["so_tornado_bravo"] = { name = "so_tornado_bravo", desc = "Tornado\n \nНякои отделни части на този сувенир от Ali са плътно боядисани със спрей в цветова схема „торнадо“.\n\nДумите са само вятър, но и той може да убива" },
	["so_sand_bravo"] = { name = "so_sand_bravo", desc = "Sand Dune\n \nНякои отделни части на този сувенир от Gwalior са плътно боядисани със спрей в цветова схема „пясъчна дюна“.\n\nГонзо журналистът, Алекс Кинкейд, изчезна след пътуване до Магреб, с цел да отрази операция „Авангард“" },
	["so_olive_bravo"] = { name = "so_olive_bravo", desc = "Groundwater\n \nНякои отделни части на този сувенир от Cache са плътно боядисани със спрей в еднообразна маслиненозелена цветова схема.\n\nНикога не приемайте победата за даденост" },
	["an_gunmetal_bravo"] = { name = "an_gunmetal_bravo", desc = "Anodized Gunmetal\n \nТози сувенир от Siege е боядисан в цвета на месингова метална сплав с анодно оксидиран ефект върху хромирана основа.\n\nНе познавате Феликс Райли като мен… невъзможно е да го пречупите — „Предателят и търсачът на истина“, част I" },
	["am_ossify_blue_p2000_bravo"] = { name = "am_ossify_blue_p2000_bravo", desc = "Ocean Foam\n \nТози сувенир от Seaside е украсен посредством прозрачно синя абстрактна хидрографика върху основа тип металик.\n\nВълните се разбиват, но не и нашата решителност — Котаро Изаки, експерт по пробивите" },
	["am_crumple_bravo"] = { name = "am_crumple_bravo", desc = "Graphite\n \nТози сувенир от Agency е боядисан в многоъгълна шарка чрез металически бои с различни отражения върху хромирана основа.\n\nМоливите долу, ръцете горе" },
	["aq_steel"] = { name = "aq_steel", desc = "Rust Coat\n \nВсе още функционира отлично, въпреки че външната повърхност е ръждясала.\n\nНякои хора нямат нужда да крият колко са мръсни делата им" },
	["hy_hex"] = { name = "hy_hex", desc = "Hive\n \nHexane\n \nУкрасено посредством хидрографика с шарка от шестоъгълници." },
	["hy_camo_large"] = { name = "hy_camo_large", desc = "Blind Spot\n \nУкрасено посредством хидрографика от уголемена камуфлажната шарка." },
	["am_ddpatdense"] = { name = "am_ddpatdense", desc = "Steel Disruption\n \nCobalt Disruption\n \nПокрито в метално фолио щамповано с разпокъсана цифрова шарка." },
	["twigs"] = { name = "twigs", desc = "Ash Wood\n \nБоядисано със спрей чрез ръчно рисувани шаблони с клонки." },
	["varicamo"] = { name = "varicamo", desc = "CaliCamo\n \nFull Stop\n \nNight Ops\n \nUrban Rubble\n \nVariCamo\n \nVariCamo Blue\n \nУкрасено посредством хидрографика с шарка от променлив камуфлаж.\n\nВъзобновяването идва само вследствие на разрухата" },
	["aq_damascus_knife"] = { name = "aq_damascus_knife", desc = "Damascus Steel\n \nИзковано е чрез заготовка направена от два различни типа въглеродна стомана.\n\nНай-сетне, достатъчно здраво оръжие, което съответства на решителността Ви" },
	["am_crystallized"] = { name = "am_crystallized", desc = "Red Quartz\n \nCobalt Quartz\n \nSilver Quartz\n \nMeteorite\n \nБоядисано с металически бои и използва кристаловидна маска, за да се създаде шарка.\n\nВсеки иска да остави своята следа" },
	["snakeskin"] = { name = "snakeskin", desc = "Pit Viper\n \nRed Python\n \nУкрасено посредством хидрографика с шарка от змийска кожа.\n\nЗнам, че не вярваш в каузата… и когато те разкрия, Валерия ще ти отнесе главата — „Щитът и змията“ част I" },
	["cu_usp-s_elegant"] = { name = "cu_usp-s_elegant", desc = "Guardian\n \nБоядисано е в кобалтово синьо и щамповано с логото на КТ върху плъзгача.\n\nМога да следвам процедурата и ще измъкна 7 или го правя по моя начин спасявайки всичките 10… ти избираш — Кармен Косинеро, спасителен експерт" },
	["hy_plaid2"] = { name = "hy_plaid2", desc = "Green Plaid\n \nУкрасено посредством хидрографика от сиво-кафява и синьо-зелена карирана шарка.\n\nНе е гайда, но изсвирва една песен преди всяко погребение" },
	["cu_fiveseven_urban_hazard"] = { name = "cu_fiveseven_urban_hazard", desc = "Urban Hazard\n \nБоядисано с персонализиран камуфлажен дизайн с червени акценти.\n\nВсяка година Буут сбира най-изтъкнатите световни оръжейни дизайнери, които да покажат най-новите си проекти" },
	["an_emerald"] = { name = "an_emerald", desc = "Emerald\n \nБоядисано в прозиращ изумруденозелен слой с анодно оксидиран ефект върху хромирана основа.\n\nДо това ли е бил принизен великият Себастиен Хенекет? Заядлив стар учител? Какво е станало с теб… — „Учителят и иконоборецът“ част II" },
	["so_keycolors"] = { name = "so_keycolors", desc = "Impact Drill\n \nНякои отделни части са плътно боядисани със спрей в синьо-оранжева цветова схема.\n\nВеликият изравнител" },
	["cu_awp_mastery"] = { name = "cu_awp_mastery", desc = "Elite Build\n \nУкрасено посредством персонализирана комбинация от хидрографики и внимателно ползвани шаблонни шарки и подчертано чрез топлинно приложени щампи.\n\nЧейс Търнър беше велик човек… Трябва да оправдаете доста големи очаквания — „Фениксът и посветеният“, част I" },
	["aq_dualberettas_cartel"] = { name = "aq_dualberettas_cartel", desc = "Cartel\n \nГравирано с изображение на скелети, цветя и змии.\n\nЕто защо Хъксли върши тежката работа, а ние само трябва да я побутваме напред… — „Змията и търсачът на истината“, част II" },
	["aq_famas_contour"] = { name = "aq_famas_contour", desc = "Valence\n \nБоядисано с персонализиран в модерен червено-сив дизайн, който допринася към очертанията на оръжието.\n\nВинаги сме по-силни заедно" },
	["cu_nova_hyperbeast"] = { name = "cu_nova_hyperbeast", desc = "Hyper Beast\n \nБоядисано с персонализирано изображение на зверска твар в еуфористични цветове.\n\nНаричат те Они, нали? Колко страшно име за такъв тъжен човек… — Елиът Кингсман, наемник" },
	["hy_ocean_knife"] = { name = "hy_ocean_knife", desc = "Bright Water\n \nУкрасено посредством синя камуфлажна хидрографика." },
	["cu_m4a1s_printstream"] = { name = "cu_m4a1s_printstream", desc = "Printstream\n \nБоядисано с персонализиран ярък черно-бял дизайн и акценти с перлено гланцов завършек.\n\nБЯЛО_1; ЧЕРНО_1; ПЕРЛЕНО_ГЛАНЦОВ_ЗАВЪРШЕК_1; ЗАГЛУШЕНО_1;" },
	["cu_usp_printstream"] = { name = "cu_usp_printstream", desc = "Printstream\n \nБоядисано с персонализиран ярък черно-бял дизайн и акценти с перлено гланцов завършек.\n\nБЯЛО_1; ЧЕРНО_1; ПЕРЛЕНО_ГЛАНЦОВ_ЗАВЪРШЕК_1; ЗАГЛУШЕНО_1; ПИСТОЛЕТ_1;" },
	["m4a1s_black_lotus"] = { name = "m4a1s_black_lotus", desc = "Black Lotus\n \nБоядисано персонализирано с черно лотосово цвете и лилава основа.\n\nДобавя 2 убийства по време на рунд с винтовки, а след това се захвърля" },
	["ssg08_dezastre"] = { name = "ssg08_dezastre", desc = "Dezastre\n \nБоядисано с персонализиран високотехнологичен дизайн в черно, бяло и червено.\n\nВинаги следвайте насоките на производителя за безопасна употреба" },
	["ump45_neo_noir"] = { name = "ump45_neo_noir", desc = "Neo-Noir\n \nБоядисано с персонализирана стилизирана синьо пурпурна жена върху сив фон.\n\n„С острие в ръка тя реши, че е време да заеме позиция и да се възпротиви“" },
}
